(734,180,'1',NULL,441,'<h2>QUEM SOMOS</h2>\r\n\r\n<p>Somos uma ag&ecirc;ncia de publicidade, formada por uma equipe de profissionais com experi&ecirc;ncia em Comunica&ccedil;&atilde;o Corporativa, h&aacute; mais de 35 anos como House Agency.</p>\r\n\r\n<p>Atrav&eacute;s da nossa expertise na ind&uacute;stria, decidimos ampliar os horizontes para o mercado de oportunidades em outros segmentos, compartilhando experi&ecirc;ncias, oferecendo solu&ccedil;&otilde;es criativas e inovadoras na comunica&ccedil;&atilde;o, bem como, atender as necessidades de cada cliente com qualidade e profissionalismo.</p>\r\n\r\n<p>Estamos preparados para trabalhar ao lado dos nossos clientes</p>',NULL,3,'col-sm-6','right','col-sm-6','col-sm-12',NULL,NULL,'2022-06-06 16:47:07','2022-06-06 16:47:07'),
(737,181,'1',NULL,441,'<p>Somos uma ag&ecirc;ncia de publicidade, formada por uma equipe de profissionais com experi&ecirc;ncia em Comunica&ccedil;&atilde;o Corporativa, h&aacute; mais de 35 anos como House Agency.</p>\r\n\r\n<p>Atrav&eacute;s da nossa expertise na ind&uacute;stria, decidimos ampliar os horizontes para o mercado de oportunidades em outros segmentos, compartilhando experi&ecirc;ncias, oferecendo solu&ccedil;&otilde;es criativas e inovadoras na comunica&ccedil;&atilde;o, bem como, atender as necessidades de cada cliente com qualidade e profissionalismo.</p>\r\n\r\n<p>Estamos preparados para trabalhar ao lado dos nossos clientes</p>',NULL,3,'col-sm-6','right','col-sm-6','col-sm-12',NULL,NULL,'2022-06-06 16:58:48','2022-06-06 16:58:48'),
(738,182,'1',NULL,443,'<p>O cen&aacute;rio de neg&oacute;cios est&aacute; mais horizontal, inclusivo e social.</p>\r\n\r\n<p>A m&iacute;dia social permite a conex&atilde;o das pessoas, eliminando barreiras geogr&aacute;ficas e demogr&aacute;ficas, com processos de compras se tornando mais social e o consumidor buscando avalia&ccedil;&otilde;es e conselhos tanto online como off-line, para tomada das decis&otilde;es.</p>\r\n\r\n<p>Convidamos voc&ecirc; a embarcar nessa mudan&ccedil;a com o nosso time de especialista que ir&aacute; te ajudar navegar nesse mar, onde a concorr&ecirc;ncia e a competi&ccedil;&atilde;o, s&atilde;o as grandes ondas.</p>',NULL,3,'col-sm-6','left','col-sm-6','col-sm-12',NULL,NULL,'2022-06-08 23:14:31','2022-06-08 23:14:31'),
(739,183,'1',NULL,437,'<p>Nossa equipe de produ&ccedil;&atilde;o Audiovisual &eacute; movida por desafios. Nosso Roteirista conta sua hist&oacute;ria, nosso Produtor audiovisual, trabalha no planejamento e acompanha a execu&ccedil;&atilde;o do seu projeto, nosso Diretor de fotografia tem a responsabilidade de acompanhar a produ&ccedil;&atilde;o das melhores cenas que transmitam valor ao seu produto e sua hist&oacute;ria, nossos Editores de v&iacute;deo e Cinegrafistas s&atilde;o os respons&aacute;veis pela captura das emo&ccedil;&otilde;es, dos detalhes e da magia de transportar sua hist&oacute;ria para tela, criando vida aos seus personagens e produtos.</p>\r\n\r\n<p>Conte com a Rause, para contar sua hist&oacute;ria.</p>',NULL,3,'col-sm-6','right','col-sm-6','col-sm-12',NULL,NULL,'2022-06-08 23:15:10','2022-06-08 23:15:10'),
(744,184,'1',NULL,442,'<p>A arte não possui uma definição única no seu significado, a arte pode ser algo que é belo, seu principal objetivo é expressar a emoção ou sentimento e está sempre em constante evolução.</p>\r\n\r\n<p>Nossos artistas gráficos especializados na arte contemporânea, além do domínio da linguagem e das ferramentas, são alimentados pela paixão e liberdade de expressão nas criações das peças promocionais, refletindo nas diagramações e nas artes, um visual estético, equilibrado e harmonioso.</p>\r\n\r\n<p>Os talentos da Rause, estão ansiosos para representar através da sua arte, o verdadeiro significado do seu negócio.</p>',NULL,3,'col-sm-6','right','col-sm-6','col-sm-12',NULL,NULL,'2022-06-08 23:29:05','2022-06-08 23:29:05'),
(745,185,'1',NULL,440,'<p>O mercado de feiras e eventos influencia cada vez mais a vida econ&ocirc;mica das empresas, tornando-se protagonista na promo&ccedil;&atilde;o de novos neg&oacute;cios. Ano a ano, ele cresce em n&uacute;meros, propor&ccedil;&otilde;es e graus de sofistica&ccedil;&atilde;o, tornando a organiza&ccedil;&atilde;o uma tarefa trabalhosa, especializada e de grande responsabilidade.</p>\r\n\r\n<p>N&oacute;s da Rause temos experi&ecirc;ncia tanto no mercado nacional como internacional e podemos oferecer uma parceria na organiza&ccedil;&atilde;o e coordena&ccedil;&atilde;o de sua participa&ccedil;&atilde;o em feiras e eventos que venham contribuir para o crescimento do seu neg&oacute;cio, alavancar a imagem da sua empresa, aumentar suas vendas e aprimorar o relacionamento com seus clientes, parceiros e fornecedores.</p>',NULL,3,'col-sm-6','left','col-sm-6','col-sm-12',NULL,NULL,'2022-06-08 23:31:02','2022-06-08 23:31:02'),
(746,186,'1',NULL,NULL,'<p>O Cliente &eacute; o motivo pelo qual a Rause existe. A valoriza&ccedil;&atilde;o na presta&ccedil;&atilde;o dos servi&ccedil;os &eacute; o nosso investimento para atender com excel&ecirc;ncia &agrave;s necessidades e juntos, conquistar seus objetivos. Se voc&ecirc; est&aacute; precisando de um bom parceiro, o time da Rause estar&aacute; pronto para juntos unirmos as nossas ideias.</p>',NULL,3,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-06-08 23:53:24','2022-06-08 23:53:24'),
(747,187,'1',NULL,NULL,'<p>teste</p>',NULL,3,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-06-10 13:40:01','2022-06-10 13:40:01'),
(759,196,'1',NULL,NULL,'<p>Fechando a programa&ccedil;&atilde;o de atividades em homenagem ao Dia Internacional da Mulher, na noite de 5 de mar&ccedil;o, as palestrantes Arlete Mendes e Carla Hammes promoveram em nosso Audit&oacute;rio a palestra &ldquo;Por uma vida equilibrada&rdquo;.</p>\r\n\r\n<p>Os participantes contribu&iacute;ram com o ingresso solid&aacute;rio para o Renopas, ampliaram seus conceitos e ainda interagiram de forma leve e descontra&iacute;da.</p>\r\n\r\n<p>Confira os principais cliques:</p>',NULL,3,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-06-23 14:42:19','2022-06-23 14:42:19'),
