(829,204,'1',NULL,818,'<h2 style=\"text-align: center;\">&nbsp;</h2>\r\n\r\n<h2 style=\"text-align: center;\">Conquista &eacute; um reconhecimento dos servi&ccedil;os desenvolvidos pela associa&ccedil;&atilde;o</h2>\r\n\r\n<p>A APVE celebra mais uma conquista! A associa&ccedil;&atilde;o foi declarada pela Lei n&ordm; 10.524/2022 como entidade de Utilidade P&uacute;blica Municipal. A lei foi aprovada por unanimidade pela C&acirc;mara Municipal e sancionada pelo Prefeito de S&atilde;o Jos&eacute; dos Campos, Anderson Farias, no uso das atribui&ccedil;&otilde;es legais que lhe s&atilde;o conferidas pelo inciso VII do artigo 93 da Lei Org&acirc;nica do Munic&iacute;pio, de 5 de abril de 1990.</p>\r\n\r\n<p>Esse reconhecimento, atestado pela Funda&ccedil;&atilde;o Cultural Cassiano Ricardo (FCCR), ressalta a relev&acirc;ncia das atividades culturais promovidas pela APVE para seus associados e n&atilde;o associados, al&eacute;m dos feitos realizados pelo grupo RENOPAS, Farm&aacute;cia e Servi&ccedil;o Social.<br />\r\nCom transpar&ecirc;ncia e idoneidade, a APVE segue com seus trabalhos rumo &agrave; amplia&ccedil;&atilde;o dos servi&ccedil;os prestados aos seus associados, especialmente os que tenham alguma vulnerabilidade social ou de sa&uacute;de, e &agrave; comunidade.</p>\r\n\r\n<h3>Informa&ccedil;&otilde;es</h3>\r\n\r\n<p>Quer se tornar um associado? Procure a secretaria da APVE presencialmente, pelo telefone (12) 3925-5200 ou pelo e-mail e apve@apve.com.br.<br />\r\n&nbsp;</p>',NULL,3,NULL,'left',NULL,NULL,NULL,NULL,'2022-08-04 16:41:26','2022-08-04 16:41:26'),
(832,206,'1',NULL,817,'<h2 style=\"text-align: center;\">Agora, &eacute; poss&iacute;vel se tornar um S&oacute;cio Especial a partir do tempo m&iacute;nimo de 5 anos de servi&ccedil;os prestados &agrave; Embraer</h2>\r\n\r\n<p>A APVE apresenta uma novidade: a partir de agora, ex-funcion&aacute;rio do grupo Embraer pode ser tornar um candidato &agrave; S&oacute;cio Especial da APVE com a comprova&ccedil;&atilde;o de tempo m&iacute;nimo de cinco (5) anos de trabalho no grupo.</p>\r\n\r\n<p>O novo regimento, aprovado em reuni&atilde;o do Conselho Deliberativo, diminuiu o tempo de servi&ccedil;os prestados &ndash; que antes era de oito (8) anos -, visando possibilitar a mais ex-colaboradores da Embraer a oportunidade de ser tornar um associado.</p>\r\n\r\n<p>O candidato a S&oacute;cio Especial deve retirar a ficha de filia&ccedil;&atilde;o e carta de indica&ccedil;&atilde;o na sede ou nos escrit&oacute;rios, e entregar preenchidos juntamente com as c&oacute;pias dos documentos solicitados. Dever&aacute; ser comprovado o tempo m&iacute;nimo de (5) cinco anos de trabalho no grupo Embraer por meio da CTPS (Carteira de Trabalho) e n&atilde;o mais pertencer ao quadro de funcion&aacute;rios da empresa.<br />\r\nInforma&ccedil;&otilde;es</p>\r\n\r\n<p>Para se tornar um associado, procure a secretaria da APVE presencialmente, pelo telefone (12) 3925-5200 ou pelo e-mail e apve@apve.com.br.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-08-04 16:49:56','2022-08-04 16:49:56'),
