(1136,215,'1',NULL,829,'<p>&nbsp;</p>\r\n\r\n<p>Biblioteca APVE - Conforto, lazer e cultura</p>\r\n\r\n<p>A biblioteca da APVE &eacute; um espa&ccedil;o que oferece para o Associado conforto e boa leitura. Venha nos visitar e conhecer o acervo que disponibilizamos especialmente para voc&ecirc;.<br />\r\nA biblioteca foi montada com diversas tem&aacute;ticas incluindo avia&ccedil;&atilde;o, romances, cr&ocirc;nicas, aventura, autoajuda at&eacute; mesmo livros infanto-juvenil.</p>\r\n\r\n<p>Possui t&iacute;tulos que agradam a adultos e crian&ccedil;as, proporcionando a leitura em fam&iacute;lia. Aqui voc&ecirc; encontra livros, revistas e jornal para empr&eacute;stimo ou para leitura no local.&nbsp;</p>\r\n\r\n<p>Todos o acervo bibliogr&aacute;fico est&aacute; catalogado por t&iacute;tulo, autor, assunto, g&ecirc;nero e palavra-chave para facilitar a consulta online.</p>\r\n\r\n<p>Estrutura: ambiente climatizado, mesas, cadeiras e sof&aacute;s.<br />\r\nHor&aacute;rio de funcionamento: De segunda &agrave; sexta-feira, das 9h &agrave;s 17h30.<br />\r\nTelefone WhatsApp: (12) 3925-5209.</p>\r\n\r\n<p>Consulte nosso acervo de livros na &aacute;rea do associado.</p>',NULL,3,NULL,'none','col-sm-12','col-sm-12',NULL,NULL,'2022-08-10 19:51:18','2022-08-10 19:51:18'),
(1242,220,'1',NULL,NULL,'<p>&nbsp;</p>\r\n\r\n<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/t4DVf_tlqMs\" title=\"YouTube video player\" width=\"100%\"></iframe></p>\r\n\r\n<p>Desde 2001, a parceria firmada entre a APVE e a Uniodonto, promove uma s&eacute;rie de vantagens aos nossos associados.<br />\r\nA Uniodonto conta com 362 dentistas cooperados que atendem a aproximadamente 140 mil benefici&aacute;rios nas 20 cidades vinculadas &agrave; Uniodonto S&atilde;o Jos&eacute; dos Campos.</p>\r\n\r\n<p>Ao aderir ao conv&ecirc;nio, o associado da APVE pode optar pelo Plano Verde ou o Plano Prata, ambos sem car&ecirc;ncia para a ades&atilde;o e permitem a inclus&atilde;o de agregados como pai, m&atilde;e; filhos solteiros maiores de idade e menor sob guarda.</p>\r\n\r\n<p>A diferen&ccedil;a b&aacute;sica entre as op&ccedil;&otilde;es &eacute; que no plano verde o valor &eacute; mais acess&iacute;vel e com descontos para toda a fam&iacute;lia, j&aacute; o plano prata o mant&eacute;m o valor individual e oferece cobertura diferenciada para procedimentos em ortodontia e pr&oacute;teses remov&iacute;veis.<br />\r\nServi&ccedil;os: Nos dois planos, a cobertura compreende procedimentos nas &aacute;reas de endodontia, periodontia, dent&iacute;stica, alguns procedimentos cir&uacute;rgicos e alguns tipos de pr&oacute;teses, al&eacute;m de exames, atos de preven&ccedil;&atilde;o em sa&uacute;de bucal, radiologia e atendimento de urg&ecirc;ncia e de emerg&ecirc;ncia.</p>\r\n\r\n<p>Diferenciais: A Uniodonto ainda oferece uma s&eacute;rie de vantagens e comodidades exclusivas aos seus conveniados.<br />\r\nEntre as principais vantagens est&atilde;o o aplicativo para aparelhos celulares que permite buscar um dentista filtrando por nome, cidade, &aacute;rea de atua&ccedil;&atilde;o ou especialidade, al&eacute;m de consultar a rede de atendimento da Uniodonto em todo o pa&iacute;s.<br />\r\nOutra comodidade oferecida &eacute; o servi&ccedil;o de Pronto Atendimento 24 horas, que est&aacute; localizado na rua Vila&ccedil;a, 843, na Santa Casa de S&atilde;o Jos&eacute; dos Campos, no centro da cidade.<br />\r\n&nbsp;</p>',NULL,3,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-08-11 14:50:34','2022-08-11 14:50:34'),
(1243,220,'1',NULL,NULL,'<h4>Diferenciais dos Planos Uniodonto/APVE:</h4>\r\n\r\n<ul>\r\n	<li>Todos os planos odontol&oacute;gicos n&atilde;o t&ecirc;m car&ecirc;ncia;&nbsp;</li>\r\n	<li>Maior sistema odontol&oacute;gico em abrang&ecirc;ncia no pa&iacute;s;</li>\r\n	<li>Acesso a todas as especialidades odontol&oacute;gicas;</li>\r\n	<li>Atendimento personalizado;</li>\r\n	<li>Garantia de um ano para os servi&ccedil;os prestados;</li>\r\n	<li>Livre escolha do dentista cooperado em todas as especialidades odontol&oacute;gicas;</li>\r\n	<li>Atendimento em todas as regi&otilde;es do pa&iacute;s para urg&ecirc;ncias;</li>\r\n	<li>Dedu&ccedil;&atilde;o no Imposto de Renda (IR) de 100% do investimento;</li>\r\n	<li>Cobertura para dependentes igual &agrave; cobertura do titular.</li>\r\n	<li>Aplicativo exclusivo.<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>Parcelamento dos Tratamentos</strong></p>\r\n\r\n<p>Para os tratamentos que n&atilde;o s&atilde;o cobertos pelo seu Plano Odontol&oacute;gico, como pr&oacute;teses, implantes e clareamento, a Uniodonto S&atilde;o Jos&eacute; dos Campos oferece o parcelamento do valor.</p>\r\n\r\n<p>Voc&ecirc; pode escolher uma destas op&ccedil;&otilde;es:<br />\r\nNegociando diretamente com o dentista conveniado: 3x sem juros no boleto banc&aacute;rio ou 12x sem juros no cart&atilde;o de cr&eacute;dito ou d&eacute;bito autom&aacute;tico para cart&otilde;es dos Bancos do Brasil, Ita&uacute; e Santander.</p>\r\n\r\n<p>Negociando da sede da Uniodonto de S&atilde;o Jos&eacute; dos Campos: 12x sem juros (mediante consulta ao SPC/Serasa) ou 30% de entrada e saldo em at&eacute; 6x sem juros no boleto banc&aacute;rio ou 50% de entrada e saldo em at&eacute; 12x sem juros.</p>\r\n\r\n<p><em>Obs: Todos as op&ccedil;&otilde;es de parcelamento est&atilde;o sujeitas a consultas e autoriza&ccedil;&otilde;es pr&eacute;vias.</em><br />\r\n&nbsp;</p>',NULL,4,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-08-11 14:50:34','2022-08-11 14:50:34'),
(1244,220,'1',NULL,NULL,'<p><strong>Carteirinha da Uniodonto agora &eacute; digital</strong></p>\r\n\r\n<p>Para acessar, basta baixar o aplicativo Uniodonto SJC</p>\r\n\r\n<p>A APVE informa aos associados que possuem o conv&ecirc;nio da Uniodonto que, a partir de agora, a carteirinha &eacute; digital. Para obt&ecirc;-la, basta baixar o aplicativo Uniodonto SJC no celular, pelo Google Play ou APP Store, e no primeiro acesso utilizar o CPF como &ldquo;login&rdquo; e repeti-lo como &ldquo;senha&rdquo;.<br />\r\nNo aplicativo Uniodonto SJC &eacute; poss&iacute;vel ter acesso ao seu perfil, encontrar dentistas cadastrados, aprova&ccedil;&atilde;o de guia, notas fiscais, boletos, declara&ccedil;&atilde;o de imposto de renda, entre outras funcionalidades. A mudan&ccedil;a ocorre como uma maneira de contribuir com o meio ambiente e eliminar o uso de pl&aacute;stico no planeta.&nbsp;</p>\r\n\r\n<p>Baixe o aplicativo Uniodonto SJC:</p>\r\n\r\n<p><strong>Para IOS</strong><br />\r\n<a class=\"btn btn-primary\" href=\"https://apps.apple.com/br/app/uniodonto-sjc/id1453896102\" target=\"_blank\">Apple Store</a> &nbsp;</p>\r\n\r\n<p><strong>Para Android</strong><br />\r\n<a class=\"btn btn-primary\" href=\"https://play.google.com/store/apps/details?id=com.uniodontosjc.app&amp;hl=pt_BR&amp;gl=US \" target=\"_blank\">Play Store</a></p>\r\n\r\n<p><strong>ADQUIRA J&Aacute; SEU PLANO APVE / UNIODONTO!</strong><br />\r\nPara mais informa&ccedil;&otilde;es ligue para (12) 3925-5213 ou nos envie uma mensagem no WhatsApp (12) 3925-5205.<br />\r\n&nbsp;</p>',NULL,5,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-08-11 14:50:34','2022-08-11 14:50:34'),
(1250,221,'1',NULL,NULL,'<p>Crown Odonto oferece condi&ccedil;&otilde;es especiais para associados APVE&nbsp;</p>\r\n\r\n<p>Crown Odonto &eacute; a mais nova op&ccedil;&atilde;o de conv&ecirc;nio odontol&oacute;gico dispon&iacute;vel aos nossos s&oacute;cios. Confira!</p>\r\n\r\n<p>A sa&uacute;de bucal &eacute; um dos seus maiores patrim&ocirc;nios. E hoje em dia para se ter tranquilidade &eacute; preciso contar com uma assist&ecirc;ncia odontol&oacute;gica de alto n&iacute;vel que possa oferecer uma infraestrutura completa, preparada para os mais diversos tipos de atendimentos. Com mais de 25 anos de atua&ccedil;&atilde;o no mercado e com quatro notas m&aacute;ximas na ANS (Ag&ecirc;ncia Nacional de Sa&uacute;de Suplementar), a operadora possui mais de 180 especialistas credenciados em S&atilde;o Jos&eacute; dos Campos e oferece servi&ccedil;os de Central de Atendimento e Pronto Socorro para emerg&ecirc;ncias 24 horas.</p>\r\n\r\n<p>O Plano Especial Plus da Crown Odonto oferece atendimento emergencial, restaura&ccedil;&otilde;es, odontopediatria, endodontia, cirurgia, entre outros. O Plano Executivo oferece 18 procedimentos adicionais em rela&ccedil;&atilde;o ao contrato b&aacute;sico da operadora.</p>\r\n\r\n<p><strong>Condi&ccedil;&otilde;es especiais, confira:</strong></p>\r\n\r\n<ul>\r\n	<li>Plano Especial Plus CA - R$ 22,50</li>\r\n	<li>Plano Executivo - R$ 28,77</li>\r\n</ul>\r\n\r\n<p>Entre em contato com o setor de conv&ecirc;nios da APVE e conhe&ccedil;a melhor a nova operadora que est&aacute; em parceria com a APVE.&nbsp;<br />\r\nPara mais informa&ccedil;&otilde;es ligue (12) 3925-5205 ou 3925-5213 ou mande um email para convenios@apve.com.br.&nbsp;<br />\r\n&nbsp;</p>',NULL,3,'col-sm-12','none','col-sm-4','col-sm-12',NULL,NULL,'2022-08-11 14:52:19','2022-08-11 14:52:19'),
(1251,221,'1',NULL,859,NULL,NULL,4,'col-sm-12','none','col-sm-12','col-sm-12',NULL,NULL,'2022-08-11 14:52:19','2022-08-11 14:52:19'),
(1254,222,'1',NULL,868,'<p>&nbsp;</p>\r\n\r\n<p>A parceria com a corretora METLIFE proporciona seguros de vida para homens, mulheres, idosos, al&eacute;m do plano completo familiar.</p>\r\n\r\n<p>O limite de faixa et&aacute;ria e capital m&aacute;ximo segurado seguir&atilde;o as condi&ccedil;&otilde;es gerais da ap&oacute;lice.</p>\r\n\r\n<p>A prote&ccedil;&atilde;o necess&aacute;ria a voc&ecirc; e sua fam&iacute;lia pode ser adquirida por nossos funcion&aacute;rios do setor de atendimento de conv&ecirc;nios da APVE. Saiba mais pelos telefones (12) 3925-5205 ou 5213.</p>',NULL,3,'col-sm-12','left','col-sm-12','col-sm-12',NULL,NULL,'2022-08-11 14:56:49','2022-08-11 14:56:49'),
(1419,230,'1',NULL,NULL,NULL,NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-08-15 18:27:30','2022-08-15 18:27:30'),
(1524,275,'1',NULL,1021,'<p align=\"center\" style=\"text-align:center; margin-bottom:11px\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:12.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">PALESTRA </span></span></span></b></span></span></span></p>\r\n\r\n<p align=\"center\" style=\"text-align:center; margin-bottom:11px\"><br />\r\n<span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:18.0pt\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">RENOPAS promove palestra beneficente sobre &ldquo;Como lidar com conversas desafiadoras&rdquo;</span></span></span></b></span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Di&aacute;logos dif&iacute;ceis sempre ser&atilde;o dif&iacute;ceis, o que podemos &eacute; modificar como </span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">respondemos a cada desafio.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><b><span style=\"line-height:107%\">T&Oacute;PICOS A SEREM ABORDADOS:&nbsp;</span></b></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">As t&eacute;cnicas consagradas de fazer di&aacute;logos assertivos.</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Saber o que s&atilde;o necessidades e sentimentos envolvidos no di&aacute;logo segundo a Comunica&ccedil;&atilde;o n&atilde;o violenta.</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Entender o que s&atilde;o &ldquo;os 3 di&aacute;logos&rdquo; segundo a teoria de Harvard Negotiation Project</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Diferenciar o que s&atilde;o necessidades e o que s&atilde;o estrat&eacute;gias</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Perceber o tipo de programa&ccedil;&atilde;o mental que adota nos di&aacute;logos.</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Perceber o di&aacute;logo interno que te impede de ter escuta.</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Identificar, entender e dar NOME aos sentimentos.</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Saber como os di&aacute;logos dif&iacute;ceis afetam sua autoestima e identidade.</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-bottom:11px; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Aprender os principais passos para reconstru&ccedil;&atilde;o do di&aacute;logo.</span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><b><span style=\"line-height:107%\">PALESTRANTE&nbsp;</span></b></span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">DENISE DE CAMARGO &eacute; Psic&oacute;loga, Psicopedagoga, Coach, idealizadora do programas e &ldquo;Di&aacute;logo assertivo &eacute; sucesso nos relacionamentos&rdquo; e em parceria com a Good Talents do &ldquo;PDT &ndash; Programa de Direcionamento de Jovens Talentos&rdquo; .Facilitadora de treinamentos comportamentais, Assessment e mentoria. Professional and Self Coach (PSC) e Life Coach - Instituto Brasileiro de Coach (IBC) em conson&acirc;ncia com comunidades e institutos internacionais. Leader Coach - Behavioral Coaching Institute (BCI). Leader Executive Coach. Coach vocacional com projeto Escolar. Especialista em carreira &ndash; Instituto Maur&iacute;cio Sampaio (IM). Analista Comportamental DISC, PDA, Software Coaching Assessment e ADV da INNERMETRIX. Orienta&ccedil;&atilde;o Vocacional Cl&iacute;nica&ndash; Labore.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><b><span style=\"line-height:107%\">Informa&ccedil;&otilde;es:</span></b></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Data: 15/setembro/2022, (Quinta-feira)</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">In&iacute;cio: 19h00 </span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">T&eacute;rmino previsto: 20h30</span></span></span></span></li>\r\n	<li style=\"text-align:justify; margin-bottom:11px; margin-left:8px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">Inscri&ccedil;&otilde;es: <a href=\"https://forms.office.com/r/A6uB3aPLjh\">clique aqui </a>e preencha o formul&aacute;rio.&nbsp;</span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\">O evento &eacute; promovido pelo Grupo Reciclando Nosso Papel Social (RENOPAS) e o valor para participar &eacute; de R$ 10,00 por pessoa. Toda a renda ser&aacute; revertida para as obras beneficentes assistidas pelo RENOPAS e apoiadas pela APVE.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:115%\"><span style=\"color:black\">Informa&ccedil;&otilde;es tamb&eacute;m podem ser consultadas com a secretaria da APVE, pelo telefone e WhatsApp (12) 3925-5200.</span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\">&nbsp;&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify; margin-bottom:11px\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">OBS:</span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify; margin-bottom: 11px;\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">&bull;&nbsp;&nbsp;A Palestra &eacute; aberta ao P&uacute;blico em geral, isto &eacute;, n&atilde;o precisa ser Associado (a) da APVE ou Funcion&aacute;rio (a) da Embraer.</span></span></span></span></li>\r\n	<li style=\"text-align: justify; margin-bottom: 11px;\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><span style=\"line-height:107%\">&bull;&nbsp;&nbsp;Caso queira certificado (digital) de participa&ccedil;&atilde;o, por gentileza, solicit&aacute;-lo ao fazer a inscri&ccedil;&atilde;o.</span></span></span></span></li>\r\n	<li style=\"text-align: justify; margin-bottom: 11px;\"><span style=\"font-size:14px;\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><span style=\"line-height:107%\"><b><span style=\"line-height:107%\">&bull; </span></b><span style=\"line-height:107%\">O pagamento deve ser feito na recep&ccedil;&atilde;o da Palestra, entre 18h30 e 19h00.</span></span></span></span></li>\r\n</ul>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-09-09 15:33:32','2022-09-09 15:33:32'),
(1569,229,'1',NULL,NULL,'<p style=\"margin-bottom:11px\"><span style=\"font-size:72px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><b><span arial=\"\"><span style=\"color:#020256\">Farm&aacute;cia APVE</span></span></b></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">Os associados, dependentes e agregados da APVE t&ecirc;m &agrave; disposi&ccedil;&atilde;o uma&nbsp;<b>Farm&aacute;cia Comunit&aacute;ria&nbsp;</b>para distribui&ccedil;&atilde;o de medicamentos gratuitos. A Farm&aacute;cia &ldquo;Danilo Stanzani&rdquo;, foi inaugurada no dia 22 de novembro de 2012, com o objetivo de atender os associados da APVE e conveniados dos planos. O trabalho &eacute; social e sem fins lucrativos, a farm&aacute;cia recebe doa&ccedil;&otilde;es de medicamentos e os repassam aos associados. &nbsp;</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">Para retirar o medicamento &eacute; necess&aacute;ria a apresenta&ccedil;&atilde;o da receita m&eacute;dica original dentro da validade, juntamente com o n&uacute;mero do associado ou a carteirinha do seu plano de sa&uacute;de.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">A farm&aacute;cia APVE, &eacute; mantida atrav&eacute;s de recebimentos de doa&ccedil;&otilde;es, cujos medicamentos precisam estar dentro do prazo de validade e na embalagem original lacrada. Se voc&ecirc; tiver medicamentos nestas condi&ccedil;&otilde;es em casa, pode nos trazer e ajudar outras pessoas.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">A Farm&aacute;cia Comunit&aacute;ria da APVE Danilo Stanzani, funciona de segunda a sexta, das 8h &agrave;s 12h e das 13h &agrave;s 17h45. </span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#2980b9;\"><span style=\"font-size:22px;\"><b><span arial=\"\" style=\"font-family:\">► Descarte de medicamentos</span></b></span></span></span></span></span></span><br />\r\n<span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">Todo medicamento cont&eacute;m subst&acirc;ncias qu&iacute;micas que s&atilde;o potencialmente prejudiciais &agrave; Sa&uacute;de P&uacute;blica e ao Meio Ambiente, pois podem contaminar o solo e a &aacute;gua que consumimos, por isso, n&atilde;o devem ser descartados no lixo comum, na pia ou no vaso sanit&aacute;rio.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">A Farm&aacute;cia da APVE disponibiliza um espa&ccedil;o exclusivo para descarte de medicamentos vencidos. Separe o material reciclado (caixa e bula) do medicamento como pomadas, cremes, blister do comprimidos, l&iacute;quidos e sprays e deposite-os nas lixeiras espec&iacute;ficas.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span arial=\"\"><span style=\"color:#212529\">Nota Importante:</span></span></b><span arial=\"\"><span style=\"color:#212529\"> N&atilde;o consuma medicamentos vencidos e n&atilde;o jogue fora em sua casa, ou em local impr&oacute;prio, contribua para a sua sa&uacute;de e para a conserva&ccedil;&atilde;o do meio ambiente!</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#2980b9;\"><span style=\"font-size:22px;\"><b><span arial=\"\" style=\"font-family:\">► Assist&ecirc;ncia Farmac&ecirc;utica</span></b></span></span><br />\r\n<span style=\"font-size:16px;\"><span arial=\"\"><span style=\"color:#212529\">Assist&ecirc;ncia farmac&ecirc;utica &eacute; o conjunto de a&ccedil;&otilde;es e servi&ccedil;os com vistas a assegurar a assist&ecirc;ncia terap&ecirc;utica integral, a promo&ccedil;&atilde;o e a recupera&ccedil;&atilde;o da sa&uacute;de das pessoas debilitadas.<br />\r\nA Farm&aacute;cia APVE, &ldquo;Danilo Stanzani&rdquo; conta com profissionais gabaritadas para melhor atend&ecirc;-los, com a presen&ccedil;a de farmac&ecirc;utico em todo hor&aacute;rio de funcionamento, que presta assist&ecirc;ncia farmac&ecirc;utica de qualidade, esclarecendo d&uacute;vidas, e orientando para que o paciente receba o medicamento de acordo com a prescri&ccedil;&atilde;o m&eacute;dica e o administre da maneira correta.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"color:#2980b9;\"><span style=\"font-size:22px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span arial=\"\" style=\"font-family:\">► Doa&ccedil;&otilde;es e repasses de medicamentos, como funcionam?</span></b></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span arial=\"\"><span style=\"color:#212529\">Quando a farm&aacute;cia AVPE recebe as doa&ccedil;&otilde;es &eacute; feita uma triagem para verificar quais os medicamentos s&atilde;o utilizados pelos nossos pacientes, os medicamentos que n&atilde;o vamos utilizar, s&atilde;o repassados para outras institui&ccedil;&otilde;es para que sejam aproveitados, contribuindo assim, para que outros pacientes tenham acesso aos medicamentos e para que n&atilde;o se haja perda dos mesmos.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"color:#2980b9;\"><span style=\"font-size:22px;\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span arial=\"\" style=\"font-family:\">► Medicamentos gratuitos &agrave; sua disposi&ccedil;&atilde;o</span></b></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#212529\">Os medicamentos contidos em nosso estoque s&atilde;o recebidos por doadores de diversas institui&ccedil;&otilde;es, desta forma, n&atilde;o temos todo tipo de medica&ccedil;&atilde;o como em uma drogaria convencional, pois dependemos das doa&ccedil;&otilde;es para manter o estoque da Farm&aacute;cia APVE.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#212529\">Contamos com medicamentos para diversas patologias, sendo a maioria medicamentos de uso continuo. Ex: Anticoncepcionais, anti-hipertensivos, relaxante muscular, antial&eacute;rgicos, medicamentos para diabetes, entre outros.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#212529\">Voc&ecirc; n&atilde;o precisa ir at&eacute; a Farm&aacute;cia APVE, para verificar se tem o seu medicamento, basta ligar para o n&uacute;mero (12) 3925-5201 ou enviar a foto da receita por WhatsApp que a farmac&ecirc;utica e nossa auxiliar t&eacute;cnica verifica a disponibilidade do medicamento descrito.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"color:#c0392b;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:14.0pt\"><span arial=\"\" style=\"font-family:\">Fique atento &agrave; Automedica&ccedil;&atilde;o!</span></span></b></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#212529\">A automedica&ccedil;&atilde;o &eacute; a utiliza&ccedil;&atilde;o de medicamentos por conta pr&oacute;pria ou por indica&ccedil;&atilde;o de pessoas n&atilde;o habilitadas, para tratamento de doen&ccedil;as cujos sintomas s&atilde;o &ldquo;percebidos&rdquo; pelo usu&aacute;rio, sem a avalia&ccedil;&atilde;o pr&eacute;via de um profissional de sa&uacute;de (m&eacute;dico ou odont&oacute;logo).&nbsp;<br />\r\nExistem v&aacute;rios riscos ao recorrer a automedica&ccedil;&atilde;o, e uma das preocupa&ccedil;&otilde;es &eacute; o risco de intoxica&ccedil;&atilde;o.&nbsp;<br />\r\nOs analg&eacute;sicos, os antit&eacute;rmicos e os anti-inflamat&oacute;rios representam as classes de medicamentos que mais intoxicam.<br />\r\nPor isso antes de se automedicar, consulte a farmac&ecirc;utica respons&aacute;vel, assim, ela fornecer&aacute; todas as recomenda&ccedil;&otilde;es para que o medicamento seja administrado de uma a forma correta, e se houver necessidade, o paciente ser&aacute; orientado para consultar um profissional habilitado da &aacute;rea pertinente para a realiza&ccedil;&atilde;o de um diagn&oacute;stico e um poss&iacute;vel tratamento.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"margin-bottom: 11px; text-align: justify;\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#2980b9;\"><b><span style=\"font-size:14.0pt\"><span arial=\"\">► Expediente</span></span></b></span><br />\r\n<span style=\"font-size:12.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:#212529\">A Farm&aacute;cia Comunit&aacute;ria APVE &ldquo;Danilo Stanzani&rdquo; funciona de segunda a sexta, das 8h &agrave;s 12h e das 13h &agrave;s 17h45.<br />\r\n<b>Contato:</b> Telefone e <a href=\"https://api.whatsapp.com/send?phone=551239255201\">WhatsApp (12) 3925-5201</a> / e-mail farmacia@apve.com.br<br />\r\n&nbsp;</span></span></span></span></span></span></span></p>',NULL,3,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-09-12 11:51:29','2022-09-12 11:51:29'),
(1578,209,'1',NULL,NULL,'<p><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/xdooqJb0vRc\" title=\"YouTube video player\" width=\"100%\"></iframe></p>','#EDEDED',3,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1579,209,'1',NULL,NULL,'<p>&nbsp;</p>\r\n\r\n<p>A APVE &eacute; a Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer. &nbsp;Fundada em 25 de setembro de 1986. Surgiu da inciativa de alguns funcion&aacute;rios da Embraer de possu&iacute;rem um espa&ccedil;o pr&oacute;prio onde desfrutassem de momentos de lazer, partilhassem sua paix&atilde;o pela aeron&aacute;utica e preservasse a cultura da avia&ccedil;&atilde;o na regi&atilde;o.</p>\r\n\r\n<p>Com o passar dos anos o grupo de s&oacute;cios cresceu e a associa&ccedil;&atilde;o expandiu. Hoje a APVE possui um nome forte e respeitado na regi&atilde;o. Com uma estrutura em constante aperfei&ccedil;oamento atraindo cada vez mais associados.<br />\r\nA APVE visa sempre o conforto e o bem-estar. As diversas &aacute;reas de atividades contemplam prazer, corpo e mente dos seus s&oacute;cios e a intera&ccedil;&atilde;o social.</p>\r\n\r\n<p>Com as recentes reformas e novas instala&ccedil;&otilde;es a <strong>APVE </strong>proporcionam conforto, qualidade e seguran&ccedil;a. S&atilde;o sal&otilde;es de festas, piscina semiol&iacute;mpica aquecida, wi-fi, biblioteca, restaurante, salas de gin&aacute;stica, sala de pilates studio, academia, sauna, sal&atilde;o de jogos, salas de reuni&atilde;o, audit&oacute;rio, sala de proje&ccedil;&atilde;o totalmente equipada e uma farm&aacute;cia comunit&aacute;ria.</p>\r\n\r\n<p>Nas atividades culturais al&eacute;m de cursos como artes, m&uacute;sica, dan&ccedil;a, costura e literatura s&atilde;o realizados passeios, workshops, exposi&ccedil;&otilde;es, feiras,concursos e palestras para todas as idades nos mais diversos temas interessantes da atualidade.</p>\r\n\r\n<p>No Esporte e Lazer, o associado <strong>APVE </strong>conta com diversas atividades que ajudam a manter a sa&uacute;de e a disposi&ccedil;&atilde;o. Com equipamentos modernos e equipes especializadas a <strong>APVE </strong>oferece aulas de gin&aacute;stica, alongamento, funcional, pilates, nata&ccedil;&atilde;o, hidrogin&aacute;stica, sauna, zumba, academia, sal&atilde;o de jogos, massagens e terapias.</p>\r\n\r\n<p>A &aacute;rea de Eventos Sociais da <strong>APVE </strong>tem como premissa a divers&atilde;o de quem participa. Passeios para todas as idades acontecem a cada m&ecirc;s, destinados a toda fam&iacute;lia para o os mais diversos lugares, desde zool&oacute;gico &agrave; grava&ccedil;&atilde;o de programas de entretenimento na televis&atilde;o. Al&eacute;m de turismo, tamb&eacute;m oferece a Sexta-Dan&ccedil;ante, um dos mais tradicionais bailes da regi&atilde;o, excelente para dan&ccedil;ar e conhecer pessoas, que acontecem quinzenalmente, &agrave;s sextas-feiras.</p>\r\n\r\n<p>O atendimento ao conv&ecirc;nio m&eacute;dico media contratos, cobran&ccedil;as e orienta o associado em rela&ccedil;&atilde;o as redes de planos de sa&uacute;de, odontol&oacute;gicos e seguro de vida, com operadoras parceiras da <strong>APVE </strong>que s&atilde;o Unimed, Santa Casa Sa&uacute;de, Hapvida, Uniodonto, Crown Odonto e Met Life.</p>\r\n\r\n<p>A Assist&ecirc;ncia Social da <strong>APVE </strong>assegura suporte ao plano de sa&uacute;de em agendamento de consultas, exames, procedimentos cir&uacute;rgicos e interven&ccedil;&atilde;o junto ao plano em eventuais necessidades. Al&eacute;m de empr&eacute;stimos e aparelhos ortop&eacute;dicos, como muletas, cadeiras de rodas e de banhos, andadores e bengalas. Em parcerias com grupos, entidades e outras empresas auxilia na promo&ccedil;&atilde;o de eventos e campanhas beneficentes e de preven&ccedil;&atilde;o &agrave; sa&uacute;de.</p>\r\n\r\n<p>A Farm&aacute;cia Comunit&aacute;ria da <strong>APVE </strong>oferece medicamentos gratuitos para associados e agregados Unimed. Tamb&eacute;m aceita doa&ccedil;&otilde;es de medicamentos n&atilde;o utilizados.</p>\r\n\r\n<p>Os setores de Comunica&ccedil;&atilde;o, Financeiro, Manuten&ccedil;&atilde;o, TI, Secretaria, Academia, formados por equipes especializadas e competentes d&atilde;o todo suporte necess&aacute;rio para o funcionamento eficaz de toda a estrutura e atividades da <strong>APVE</strong>.</p>\r\n\r\n<p>Por isso, a <strong>APVE </strong>&eacute; refer&ecirc;ncia em qualidade de servi&ccedil;os e lazer, promove e mant&eacute;m viva a hist&oacute;ria da avia&ccedil;&atilde;o no Brasil e celebra quem participa dela.<br />\r\n&nbsp;</p>',NULL,4,'col-sm-12','none',NULL,'col-sm-12',NULL,'mb-5','2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1580,209,'1',NULL,879,'<p>&nbsp;</p>\r\n\r\n<p>Qualidade de vida para o associado</p>\r\n\r\n<p>Todas as atividades relacionadas ao esporte, lazer, longevidade, sa&uacute;de e qualidade de vida dos associados s&atilde;o planejadas e criadas pela diretoria de Esporte e Lazer.</p>\r\n\r\n<p>O setor vem adquirindo cada vez mais adeptos &agrave;s atividades. N&oacute;s nos preocupamos tamb&eacute;m em promover, dia ap&oacute;s dia, novas modalidades, al&eacute;m da realiza&ccedil;&atilde;o de passeios e eventos.</p>\r\n\r\n<p>Com uma m&eacute;dia de 3000 associados e frequentadores participantes, as atividades esportivas da APVE est&atilde;o sempre em alta. Al&eacute;m da nossa ampla academia, temos Nata&ccedil;&atilde;o Adulto e Infantil, Hidrogin&aacute;stica, Gin&aacute;stica Localizada, Pilates Studio, Pilates Solo, Aulas de Funcional e Alongamento, Sal&atilde;o de Jogos e relaxamento com massagens, terapias alternativas e sauna.</p>\r\n\r\n<p>Para mais informa&ccedil;&otilde;es sobre as atividades de Esporte e Lazer da APVE entre em contato atrav&eacute;s do WhatsApp (12) 3925-5215 ou atrav&eacute;s do telefone da academia (12) 3925-5219.</p>\r\n\r\n<p>Diretor: Carlos Roberto Gon&ccedil;alves</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://apve.com.br/esporte-e-lazer\">Atividades fixas&nbsp;</a></p>',NULL,5,'col-sm-12','left','col-sm-12','col-sm-12',NULL,'mt-5','2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1581,209,'1',NULL,875,'<p>&nbsp;</p>\r\n\r\n<p>A principal meta da Diretoria Cultural &eacute; a preserva&ccedil;&atilde;o da hist&oacute;ria da APVE e dos Pioneiros da Embraer. O intuito &eacute; preservar e divulgar a hist&oacute;ria das pessoas que participaram de forma efetiva da constru&ccedil;&atilde;o da ind&uacute;stria aeron&aacute;utica nacional e idealizaram a Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer.</p>\r\n\r\n<p>O representante da diretoria na atual gest&atilde;o &eacute; o diretor Christiano Sadock, sob a coordena&ccedil;&atilde;o de Alessandra Davoli, juntos planejam uma programa&ccedil;&atilde;o ampla e diversificada, e de uma forma a privilegiar v&aacute;rios segmentos e proporcionar ao associado diversidade cultural.</p>\r\n\r\n<p>A diretoria oferece uma agenda com atividades anuais fixas, como musicaliza&ccedil;&atilde;o, aula de ballet, corte e costura, dan&ccedil;a de sal&atilde;o, canto coral infantil e adulto, oficinas de arte, liter&aacute;ria e cinema, aula de viol&atilde;o, workshop e viagens para museus e cidades hist&oacute;ricas.</p>\r\n\r\n<p>A biblioteca, totalmente reformulada e com mais de 2 mil novos t&iacute;tulos adquiridos, atende o associado adulto e infantil &aacute;vidos pela leitura de bons livros e, para os apaixonados por cinema, em breve teremos um importante acervo de filmes sobre avia&ccedil;&atilde;o e alguns cl&aacute;ssicos do cinema.<br />\r\nConvidamos voc&ecirc; associado e associada para conhecer e participar das nossas atividades.</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://apve.com.br/cultura\">Atividades fixas&nbsp;</a></p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es sobre as atividades culturais da APVE entre em contato atrav&eacute;s do WhatsApp (12) 3925-5209.<br />\r\n&nbsp;</p>',NULL,6,'col-sm-12','left','col-sm-12','col-sm-12',NULL,NULL,'2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1582,209,'1',NULL,876,'<p>&nbsp;</p>\r\n\r\n<p>A Diretoria Social da APVE tem como premissa de trabalho, garantir a confraterniza&ccedil;&atilde;o e a amizade dos Pioneiros e Veteranos da Embraer e de seus familiares, por meio dos eventos sociais e do turismo social.</p>\r\n\r\n<p>A Diretoria Social tem como meta a otimiza&ccedil;&atilde;o as atividades j&aacute; desenvolvidas e tamb&eacute;m, trazer novidades para os s&oacute;cios entre passeio, viagens e eventos. Buscando proporcionar uma grade de eventos diversificada, aproximando cada vez mais as fam&iacute;lias com os valores da APVE, fidelizando os s&oacute;cios e proporcionando momentos de descontra&ccedil;&atilde;o e lazer.</p>\r\n\r\n<p>A Diretoria Social &eacute; a respons&aacute;vel por realizar os bailes das Sextas-Dan&ccedil;antes, que acontecem quinzenalmente, no Sal&atilde;o Nobre da APVE.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://apve.com.br/eventos-sociais\">Ver atividades Fixas</a></p>\r\n\r\n<p>Para mais informa&ccedil;&otilde;es sobre as atividades Sociais da APVE entre em contato atrav&eacute;s do telefone ou WhatsApp (12) 3925-5215.<br />\r\n&nbsp;</p>',NULL,7,'col-sm-12','left','col-sm-12','col-sm-12',NULL,NULL,'2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1583,209,'1',NULL,877,'<p>&nbsp;</p>\r\n\r\n<p>A equipe <strong>DASF &ndash; Diretoria de Assist&ecirc;ncia Social e Farm&aacute;cia</strong> presta atendimento pessoal, individual e personalizado, tendo em vista a &eacute;tica e o sigilo profissional, respeitando as particularidades do associado e conveniado.</p>\r\n\r\n<p>A assistentes sociais proporcionam um atendimento personalizado e auxiliam em agendamento de consultas, exames e procedimentos cir&uacute;rgicos, bem como a interven&ccedil;&atilde;o junto &agrave; Unimed para viabilizar a agiliza&ccedil;&atilde;o dos mesmos.</p>\r\n\r\n<p>A Diretoria tamb&eacute;m implementou o servi&ccedil;o de empr&eacute;stimos de aparelhos ortop&eacute;dicos, como muletas, cadeiras de rodas e de banho, andadores e bengalas para todos os associados conveniados que necessitarem e n&atilde;o estiverem em condi&ccedil;&otilde;es de comprar ou alugar esses equipamentos.</p>\r\n\r\n<p>A Farm&aacute;cia Comunit&aacute;ria da <strong>APVE </strong>&ldquo;Danilo Stanzani&rdquo; faz toda a administra&ccedil;&atilde;o e atendimento das doa&ccedil;&atilde;o de medicamentos da farm&aacute;cia.<br />\r\nJuntas criam projetos sociais e promovem eventos com palestras de cunho educativo, promo&ccedil;&atilde;o da sa&uacute;de e preven&ccedil;&atilde;o de doen&ccedil;as.</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://apve.com.br/farmacia-apve\">Ver Farm&aacute;cia</a></p>\r\n\r\n<p>Quem &eacute; atendido?<br />\r\nTodos os associados/conveniados de planos de sa&uacute;de e odontol&oacute;gico e empregados da APVE.</p>\r\n\r\n<p>Para mais informa&ccedil;&otilde;es entre em contato atrav&eacute;s dos telefones e WhatsApp:<br />\r\nAssistente Social da Manh&atilde;: (12) 3925-5214&nbsp;<br />\r\nAssistente Social da Tarde: (12) 3925-5202<br />\r\nFarm&aacute;cia: (12) 3925-5201&nbsp;<br />\r\nDiretor: Christiano Sadock<br />\r\n&nbsp;</p>',NULL,8,'col-sm-12','left','col-sm-12','col-sm-12',NULL,NULL,'2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1584,209,'1',NULL,878,'<p>&nbsp;</p>\r\n\r\n<p>O RENOPAS (Reciclando nosso papel social) &eacute; um grupo que desenvolve atividades filantr&oacute;picas para a comunidade joseense. &nbsp;Foi criado pelas esposas dos membros da Diretoria Executiva, Conselhos Deliberativo e Fiscal, em fevereiro de 2002.</p>\r\n\r\n<p>A sua finalidade &eacute; a maior integra&ccedil;&atilde;o entre as participantes com o foco na elabora&ccedil;&atilde;o de servi&ccedil;os volunt&aacute;rios junto &agrave; comunidade carente de S&atilde;o Jos&eacute; dos Campos e cidades vizinhas.</p>\r\n\r\n<p>Ao longo desses anos diversas entidades foram beneficiadas pelo grupo. Entre elas o Cantinho S&atilde;o Vicente, um lar de idosos de Monteiro Lobato.</p>\r\n\r\n<p>Voc&ecirc; pode ajudar o RENOPAS colaborando com os eventos ou participando deles. O grupo est&aacute; aberto a novas volunt&aacute;rias associadas da APVE ou esposas dos associados que desejam doar um pouco de seu tempo para as causas sociais.</p>\r\n\r\n<p>A equipe do RENOPAS prepara palestras motivacionais e workshops com temas variados para todos que queiram se atualizar no mercado ou adquirir novos conhecimentos. Acontecem sempre uma vez por m&ecirc;s, al&eacute;m de diversos cursos e eventos.</p>\r\n\r\n<p><strong>Participe e fique de olho na agenda do RENOPAS, junte-se ao grupo!</strong></p>\r\n\r\n<p>Presidente: N&iacute;sia Brand&atilde;o<br />\r\n&nbsp;</p>',NULL,9,'col-sm-12','left','col-sm-12','col-sm-12',NULL,NULL,'2022-09-12 14:33:10','2022-09-12 14:33:10'),
(1585,209,'1',NULL,880,'<p>&nbsp;</p>\r\n\r\n<p>A APVE possui uma &aacute;rea de comunica&ccedil;&atilde;o que trabalha de forma inteligente, inovadora, conectada ao mundo e &agrave;s novas tecnologias.<br />\r\nOs servi&ccedil;os oferecidos na &aacute;rea de tecnologia garantem rede de internet em toda a associa&ccedil;&atilde;o para seus associados e frequentadores, garantem o funcionamento de todo o sistema interno da APVE e a prote&ccedil;&atilde;o dados. Al&eacute;m disso a equipe traz novidades para maior comodidade, seguran&ccedil;a e atualiza&ccedil;&atilde;o, como a implementa&ccedil;&atilde;o do acesso atrav&eacute;s da biometria facial.</p>\r\n\r\n<p>A equipe de comunica&ccedil;&atilde;o engloba na empresa o planejamento, implementa&ccedil;&atilde;o e condu&ccedil;&atilde;o das a&ccedil;&otilde;es de comunica&ccedil;&atilde;o que envolve o p&uacute;blico interno, ou seja, os funcion&aacute;rios e todo o relacionamento com o p&uacute;blico externo no &acirc;mbito associativo. Possui uma equipe capaz de planejar, atender, criar e produzir campanhas, publicidades e eventos.</p>\r\n\r\n<p>A APVE traz para os seus associados e n&atilde;o associados, informa&ccedil;&otilde;es sobre Eventos Culturais, Esportivos e de Lazer, Sociais, al&eacute;m de Cursos e Palestras, funcionamento da empresa, entre outros.</p>\r\n\r\n<p>Em nossa plataforma de m&iacute;dia, contemplamos diversos ve&iacute;culos como a nossa Revista APVE, uma revista trimestral que vem com novidades em sua estrutura para p&ocirc;r em evid&ecirc;ncia nossas a&ccedil;&otilde;es, nosso associado e colaboradores.&nbsp;</p>\r\n\r\n<p>O email marketing promove, diariamente, not&iacute;cias sempre atualizadas dos principais destaques da institui&ccedil;&atilde;o. Al&eacute;m disso, nosso portal na web re&uacute;ne todas as informa&ccedil;&otilde;es de nossa associa&ccedil;&atilde;o. Aqui &eacute; poss&iacute;vel ter acesso &agrave;s not&iacute;cias, bem como &agrave;s informa&ccedil;&otilde;es de todos os setores que comp&otilde;e a APVE. Por meio de nosso site nos aproximamos do nosso associado e n&atilde;o associado, compartilhando as informa&ccedil;&otilde;es via Facebook e Instagram, nossa principal m&iacute;dia de intera&ccedil;&atilde;o com o associado, l&aacute; encontramos a rotina e a participa&ccedil;&atilde;o dos frequentadores APVE.&nbsp;</p>\r\n\r\n<p>Agora com a novidade da M&iacute;dia Indoor, que s&atilde;o as TV&rsquo;s instaladas em ambientes estrat&eacute;gicos com not&iacute;cias e destaques das atividades da associa&ccedil;&atilde;o.</p>\r\n\r\n<p>Os meios de comunica&ccedil;&atilde;o est&atilde;o em constante modifica&ccedil;&atilde;o e a APVE se esfor&ccedil;a para manter-se sempre atual e mais forte a cada ano. Nossa meta &eacute; manter esse crescimento, aprimorando as m&iacute;dias que obtiveram sucesso, buscando melhores oportunidades de divulga&ccedil;&atilde;o, sistematizando e organizando o processo de comunica&ccedil;&atilde;o. Nosso foco &eacute; buscar sempre as melhores maneiras de levar as informa&ccedil;&otilde;es da APVE at&eacute; voc&ecirc;.</p>\r\n\r\n<p>Fique atento &agrave;s nossas m&iacute;dias e entre em contato conosco!<br />\r\nComunica&ccedil;&atilde;o: (12) 3925-5208 / Ti: (12) 3925-5212 / Diretor: Thiago Demizu<br />\r\n&nbsp;</p>',NULL,10,'col-sm-12','none','col-sm-12','col-sm-12',NULL,NULL,'2022-09-12 14:33:10','2022-09-12 14:33:10'),
