(1616,218,'1',NULL,848,'<p>A Hapvida est&aacute; entre as maiores operadoras com mais de 4 milh&otilde;es de clientes, na &aacute;rea da sa&uacute;de est&aacute; h&aacute; mais de 40 anos no mercado, ao total com:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;84 Hospitais<br />\r\n&bull;&nbsp;&nbsp; &nbsp;75 Prontos Atendimentos<br />\r\n&bull;&nbsp;&nbsp; &nbsp;294 Cl&iacute;nicas<br />\r\n&bull;&nbsp;&nbsp; &nbsp;262 Centros de Diagn&oacute;stico por Imagem e Coleta Laboratorial</p>\r\n\r\n<p>A APVE e o Grupo S&atilde;o Jos&eacute; Sa&uacute;de que faz parte do sistema Hapvida, oferecem diversas op&ccedil;&otilde;es de planos para atender toda sua fam&iacute;lia!</p>\r\n\r\n<p>Com infraestrutura pr&oacute;pria na regi&atilde;o:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hospital S&atilde;o Jos&eacute;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hospital Pr&oacute;-Inf&acirc;ncia<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Centro de Especialidades M&eacute;dicas<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Centro de Diagn&oacute;stico por Imagens<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Espa&ccedil;o Pr&oacute;-S&ecirc;nior</p>\r\n\r\n<p>Cobertura<br />\r\nAmpla rede credenciada de consult&oacute;rios, laborat&oacute;rios e hospitais, de acordo com seu plano. Os clientes do Grupo S&atilde;o Jos&eacute; Sa&uacute;de poder&atilde;o ter atendimento em casos de urg&ecirc;ncia e emerg&ecirc;ncia em quase todo o territ&oacute;rio Nacional por meio das empresas associadas &agrave; Abramge &ndash; Associa&ccedil;&atilde;o Brasileira de Medicina de Grupo.<br />\r\nVerifique os locais credenciados no site www.abramge.com.br ou atrav&eacute;s do telefone 0800 722 7511.<br />\r\nPara agendar consultas na Cl&iacute;nica S&atilde;o Jos&eacute; com agilidade e conforto basta entrar em contato pela Central de Atendimentos no telefone 3925-2300.</p>\r\n\r\n<p>Sua sa&uacute;de cuidado com carinho e com um pre&ccedil;o especial!<br />\r\n&nbsp;</p>',NULL,3,'col-sm-12','right','col-sm-12','col-sm-12',NULL,NULL,'2022-09-19 17:32:48','2022-09-19 17:32:48'),
(1617,218,'1',NULL,846,'<p>&nbsp;</p>\r\n\r\n<p>Basta ser um associado para aproveitar os benef&iacute;cios dos nossos planos m&eacute;dicos, farm&aacute;cia comunit&aacute;ria e exclusividade no atendimento das nossas assistentes sociais.</p>\r\n\r\n<p>Entre em contato conosco e saiba mais, estamos te esperando! Telefones: (12) 3925-5205 (WhatsApp) / 3925-5213 / convenios@apve.com.br<br />\r\n&nbsp;</p>',NULL,4,'col-sm-12','none','col-sm-12','col-sm-12',NULL,'mt-5','2022-09-19 17:32:48','2022-09-19 17:32:48'),
