(1676,219,'1',NULL,853,'<h3 style=\"text-align: center;\">&nbsp;</h3>\r\n\r\n<h3 style=\"text-align: center;\">APVE agora tem Santa Casa Sa&uacute;de!<br />\r\nPlanos completos e com condi&ccedil;&otilde;es especiais.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O plano que cuida da sua sa&uacute;de com a melhor rede credenciada.</p>\r\n\r\n<p>A APVE oferece mais uma grande op&ccedil;&atilde;o de conv&ecirc;nio m&eacute;dico para seus associados. O acordo firmado com a Santa Casa Sa&uacute;de proporciona a voc&ecirc; alternativa em contar com uma das mais completas estruturas hospitalares da regi&atilde;o, com vasta gama de especialidades m&eacute;dicas, al&eacute;m de an&aacute;lise de exames, exames de alta complexidade e interna&ccedil;&otilde;es.</p>\r\n\r\n<p>Com mais de 20 anos de atua&ccedil;&atilde;o no mercado da regi&atilde;o, o Santa Casa Sa&uacute;de conta com mais de 1.000 m&eacute;dicos credenciados e uma das maiores redes de atendimento da regi&atilde;o com hospitais, cl&iacute;nicas e laborat&oacute;rios que podem cobrir as necessidades dos usu&aacute;rios, desde o atendimento de emerg&ecirc;ncia 24 horas at&eacute; servi&ccedil;os de alta complexidade, como a Unidade de Transplante de F&iacute;gado, Unidade de Tratamento de Queimaduras (&uacute;nico na regi&atilde;o), maternidade com parto humanizado e UTI&rsquo;s adulto e infantil.</p>\r\n\r\n<p>M&eacute;dicos em todas especialidades!<br />\r\n&bull; Cobertura completa de acordo com a Lei 9.656/98 da ANS;<br />\r\n&bull; Consultas m&eacute;dicas em todas as especialidades;<br />\r\n&bull; Interna&ccedil;&otilde;es cl&iacute;nicas e cir&uacute;rgicas sem limites de di&aacute;rias, inclusive em UTI;<br />\r\n&bull; Assist&ecirc;ncia ao parto e ao rec&eacute;m-nascido, incluindo UTI neonatal;<br />\r\n&bull; Pronto Atendimento 24 horas para Urg&ecirc;ncia e Emerg&ecirc;ncia;<br />\r\n&bull; Exames diagn&oacute;sticos.</p>\r\n\r\n<p>Al&eacute;m de toda estrutura m&eacute;dico-hospitalar, o plano tem cobertura nacional para urg&ecirc;ncias e emerg&ecirc;ncias em 22 estados brasileiros, atrav&eacute;s do Sistema Abramge e Rede Sa&uacute;de Filantr&oacute;pica.<br />\r\nAdquira seu plano hoje e garanta a sa&uacute;de e a seguran&ccedil;a que voc&ecirc; e sua fam&iacute;lia merecem. Ligue para o setor de conv&ecirc;nios da APVE e saiba mais. Telefones: (12) 3925-5205 (WhatsApp) / 3925-5213.<br />\r\nSe voc&ecirc; n&atilde;o &eacute; associado APVE, mas trabalha na Embraer h&aacute; mais de 10 anos j&aacute; pode se associar e tamb&eacute;m aproveitar de tudo o que nosso clube tem a lhe oferecer! Conhe&ccedil;a mais da APVE.<br />\r\n&nbsp;</p>',NULL,3,'col-sm-12','none','col-sm-12','col-sm-12',NULL,NULL,'2022-09-29 17:33:17','2022-09-29 17:33:17'),
(1677,219,'1',NULL,1180,NULL,NULL,4,'col-sm-12','none','col-sm-12','col-sm-12',NULL,NULL,'2022-09-29 17:33:17','2022-09-29 17:33:17'),
(1686,312,'1',NULL,NULL,'<p>&nbsp;</p>\r\n\r\n<p>O musical &ldquo;Pedro e Lobo&rdquo; fez o Dia das Crian&ccedil;as mais especial aqui na APVE!<br />\r\nEm tr&ecirc;s sess&otilde;es, a Orquestra Comunit&aacute;ria de S&atilde;o Jos&eacute; dos Campos junto ao ballet, entregaram um espet&aacute;culo magn&iacute;fico, que encantou e despertou a imagina&ccedil;&atilde;o das crian&ccedil;as.&nbsp;</p>\r\n\r\n<p>Para completar a tarde, contamos com a presen&ccedil;a dos palha&ccedil;os do projeto Colher, que durante o intervalo das apresenta&ccedil;&otilde;es garantiu boas gargalhadas dos participantes, al&eacute;m de algod&atilde;o-doce e pipoca para tornar o evento mais saboroso, confira as fotos desse momento!</p>\r\n\r\n<p>Agradecemos a Orquestra Comunit&aacute;ria de S&atilde;o Jos&eacute; dos Campos por entregar esse lindo musical, o Projeto Colher, aos colaboradores APVE, e &eacute; claro, aos participantes, em especial as crian&ccedil;as, a quem a apresenta&ccedil;&atilde;o foi feita com tanto carinho.</p>\r\n\r\n<p>Siga a APVE nas redes para saber mais sobre eventos como esse, para d&uacute;vidas e informa&ccedil;&otilde;es consulte o setor cultural da APVE, pelo e-mail cultural@apve.com.br ou pelo telefone/WhatsApp (12) 3925-5209.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-10-13 17:33:45','2022-10-13 17:33:45'),
(1690,313,'1',NULL,NULL,'<p>E a &uacute;ltima Sexta Dan&ccedil;ante do m&ecirc;s de outubro foi repleta de doces e travessuras!</p>\r\n\r\n<p>Como tema especial de Halloween, a Banda Oppus foi a respons&aacute;vel pela anima&ccedil;&atilde;o de nossos monstrinhos que n&atilde;o mediram esfor&ccedil;os na hora de escolher suas fantasias, uma mais original que a outra! E essa criatividade foi contemplada em um concurso de fantasias, e a vencedora veio de bem longe, l&aacute; das pir&acirc;mides do Egito: a m&uacute;mia! Confira nas fotos.</p>\r\n\r\n<p>Agradecemos a todos que estiveram presentes e tornaram essa sexta &ndash; trevosa &ndash; mais animada, e parab&eacute;ns a todos que se dedicaram a escolher uma fantasia e capricharam nos acess&oacute;rios para essa noite de Halloween. Foi lindo demais!<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-10-18 08:31:09','2022-10-18 08:31:09'),
(1693,316,'1',NULL,1321,'<h1 style=\"text-align: center;\"><strong>APVE tem presente especial de 36 anos para associados</strong><br />\r\n<em>Venha retirar seu brinde na sede da APVE&nbsp;</em></h1>\r\n\r\n<p><br />\r\nEm comemora&ccedil;&atilde;o aos 36 anos de APVE os associados titulares podem retirar um brinde especial na nossa sede. A campanha tem como objetivo presentear e reconhecer todas os associados que ajudaram, e ainda ajudam a construir a hist&oacute;ria da APVE.<br />\r\nPara retirar o presente, basta comparecer na secretaria da APVE, de segunda a sexta-feira, das 8h &agrave;s 17h30, at&eacute; o dia 22 de dezembro, data limite para a retirada dos brindes.</p>\r\n\r\n<p><br />\r\n<strong>&bull;&nbsp;&nbsp; &nbsp;Servi&ccedil;o:</strong><br />\r\nDistribui&ccedil;&atilde;o do brinde 36 anos<br />\r\nSede APVE: De segunda a sexta-feira, das 8h &agrave;s 17h30</p>\r\n\r\n<p><br />\r\n<em>*Presente v&aacute;lido apenas para associados titulares ativos.</em></p>\r\n\r\n<p><br />\r\nInforma&ccedil;&otilde;es:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;<a href=\"https://api.whatsapp.com/send?phone=551239255200\">Tel/WhatsApp 123925-5200</a><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Email: apve@apve.com.br<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-10-19 16:56:10','2022-10-19 16:56:10'),
(1703,322,'1',NULL,NULL,'<p>Aproveite a Banda Essencial na noite da nossa querid&iacute;ssima Sexta-Dan&ccedil;ante. Estamos esperando por voc&ecirc;!<br />\r\nMais informa&ccedil;&otilde;es com a Diretoria de Eventos Sociais pelo telefone ou WhatsApp (12) 3925-5215.&nbsp;<br />\r\nParticipe do grupo da Sexta Dan&ccedil;ante e fique por dentro de todas as novidades em primeira m&atilde;o.</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-10-24 13:33:17','2022-10-24 13:33:17'),
(1723,334,'1',NULL,1349,'<h1 style=\"text-align: center;\"><strong>Responda a pesquisa socioecon&ocirc;mica da APVE</strong><br />\r\n<em>Conhecer melhor a realidade de seus s&oacute;cios e frequentadores &eacute; o principal objetivo</em></h1>\r\n\r\n<p>A Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE), est&aacute; realizando uma pesquisa socioecon&ocirc;mica com seus s&oacute;cios e frequentadores. A ideia &eacute; conhecer cada um que faz parte da fam&iacute;lia APVE e, com isso, oferecer, cada vez mais, servi&ccedil;os de interesse desse p&uacute;blico.</p>\r\n\r\n<p>Queremos conhecer a sua realidade, acesse o link abaixo e responda todo o question&aacute;rio, s&atilde;o s&oacute; 5 minutos.&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://forms.office.com/r/TD01rZgYdi\">QUESTION&Aacute;RIO SOCIOECON&Ocirc;MICO</a></p>\r\n\r\n<p>Essa iniciativa visa a excel&ecirc;ncia dos servi&ccedil;os disponibilizados pela entidade, possibilitando que cada momento atenda a exata expectativa de cada frequentador.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-10-25 15:57:04','2022-10-25 15:57:04'),
(1724,335,'1',NULL,1351,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE recebe certificado de reconhecimento como Institui&ccedil;&atilde;o Cultural</strong><br />\r\n&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><em>Entidade recebeu a qualifica&ccedil;&atilde;o na &uacute;ltima ter&ccedil;a-feira (18)</em></h1>\r\n\r\n<p style=\"text-align: justify;\">A Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE) recebeu na &uacute;ltima ter&ccedil;a-feira (18) o Certificado de Reconhecimento como Institui&ccedil;&atilde;o Cultural. O documento foi emitido pela Secretaria de Cultura e Economia Criativa do Estado de S&atilde;o Paulo (SEC-SP) e formalizou a APVE como entidade que desenvolve a&ccedil;&otilde;es culturais em prol da cidade de S&atilde;o Jos&eacute; dos Campos.&nbsp;<br />\r\nEste t&iacute;tulo foi mais uma conquista do Diretor Cultural, Assit&ecirc;ncia Social e Farm&aacute;cia Christiano Sadock e do Presidente Ad&atilde;o Alves Brand&atilde;o que, juntos, trouxeram a formaliza&ccedil;&atilde;o da APVE como uma entidade cultural.<br />\r\nA SEC-SP &eacute; o &oacute;rg&atilde;o do Governo do Estado de S&atilde;o Paulo respons&aacute;vel por elaborar e executar pol&iacute;ticas p&uacute;blicas, visando garantir os direitos culturais da popula&ccedil;&atilde;o no territ&oacute;rio paulista.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-10-25 17:06:40','2022-10-25 17:06:40'),
(1730,308,'1',NULL,1169,'<p>&nbsp;</p>\r\n\r\n<p>Nessa &uacute;ltima ter&ccedil;a-feira, dia 20 de setembro, no sal&atilde;o nobre da APVE, o autor Claudius D&rsquo;Artagnan Barros lan&ccedil;ou o livro &ldquo;A Jornada do Consultor&rdquo;. O evento contou com a participa&ccedil;&atilde;o de empres&aacute;rios renomados da cidade, associados, familiares do autor e ex-funcion&aacute;rios da Embraer.</p>\r\n\r\n<p>O evento se iniciou com um talkshow, conduzido por dois &acirc;ncoras, Karla Clarinda, estrategista em recoloca&ccedil;&atilde;o profissional e Ant&ocirc;nio Carlos Berna, renomado consultor na &aacute;rea de Gest&atilde;o Empresarial e de Neg&oacute;cios Internacionais, que fizeram perguntas ao autor.</p>\r\n\r\n<p>Num segundo momento, ap&oacute;s o debate, foi realizada uma sess&atilde;o de aut&oacute;grafos pelo autor. Durante o evento, os convidados tiveram tempo para um bate-papo com os amigos, seguidos por um coquetel, para celebrar aquele momento t&atilde;o importante, que era o lan&ccedil;amento de uma obra liter&aacute;ria.</p>\r\n\r\n<p>Fotos de Julian Bareiro</p>',NULL,3,'col-sm-12','left','col-sm-8','col-sm-12',NULL,NULL,'2022-10-27 10:12:48','2022-10-27 10:12:48'),
(1738,340,'1',NULL,NULL,'<p>Novembro Azul na APVE &eacute; um m&ecirc;s dedicado para a&ccedil;&otilde;es preventivas contra o c&acirc;ncer de pr&oacute;stata. &Eacute; por isso, que j&aacute; no primeiro dia do m&ecirc;s, a Diretoria de Assist&ecirc;ncia Social e Farm&aacute;cia promoveu um evento com palestras, vacina&ccedil;&atilde;o, teste de glicemia, aferi&ccedil;&atilde;o da press&atilde;o arterial, atividade f&iacute;sica, massagens, avalia&ccedil;&atilde;o capilar e teste gratuito para identificar se voc&ecirc; tem risco de ter doen&ccedil;a renal cr&ocirc;nica. Um dia muito proveitoso, quem veio aproveitou muito. Confira as fotos.&nbsp;&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-11-01 17:32:15','2022-11-01 17:32:15'),
(1825,345,'1',NULL,1401,'<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1 style=\"text-align: center;\"><strong>A APVE &eacute; eleita para o Conselho Estadual do Idoso de S&atilde;o Paulo</strong><br />\r\nInstitui&ccedil;&atilde;o cumprir&aacute; mandato de dois anos</h1>\r\n\r\n<p>A Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE) agora faz parte do Conselho Estadual do Idoso de S&atilde;o Paulo (CEI-SP). A escolha se deu em 14 de outubro, quando foi publicada no Di&aacute;rio Oficial da Uni&atilde;o e sancionada pelo Governador do Estado de SP.<br />\r\nO mandato, com dura&ccedil;&atilde;o de dois anos, ser&aacute; representado pelo diretor Christiano Sadock e pela suplente, a Assistente Social, Simone Felipe. Juntos ter&atilde;o atua&ccedil;&atilde;o em duas macrorregi&otilde;es do Estado, a IV e a V, englobando regi&otilde;es como Bauru, Itapeva e os Vales do Para&iacute;ba e da Ribeira.<br />\r\nDentre as atribui&ccedil;&otilde;es do Conselheiro Estadual do Idoso est&atilde;o a defini&ccedil;&atilde;o das pol&iacute;ticas p&uacute;blicas e do uso dos recursos do Fundo Estadual do Idoso (FEI) para <strong>todos os 645 Munic&iacute;pios do Estado de SP</strong>. Atualmente, o FEI possui mais de R$ 42 milh&otilde;es de reais de saldo em conta.<br />\r\nSegundo o diretor Sadock, o desafio ser&aacute; &ldquo;definir pol&iacute;ticas p&uacute;blicas, a&ccedil;&otilde;es e projetos para beneficiar as mais de 7,5 milh&otilde;es de pessoas idosas em todo o Estado, especialmente as mais vulner&aacute;veis.&rdquo; E ressalta que existe campo de atua&ccedil;&atilde;o, como a cria&ccedil;&atilde;o de abrigos para idosos: &ldquo;Por exemplo, cerca de metade dos munic&iacute;pios do Estado n&atilde;o possui sequer um abrigo. Agora, teremos condi&ccedil;&otilde;es de atuar, dentro dos princ&iacute;pios caritativos do RENOPAS, de uma forma mais institucional e abrangente.&rdquo;&nbsp;<br />\r\nO mandato teve in&iacute;cio em novembro de 2022 e seguir&aacute; at&eacute; novembro de 2024.</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"blob:https://apve.com.br/ff9ee522-ae31-451d-87cc-aff2dafb7983\" width=\"604\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-11-08 14:52:51','2022-11-08 14:52:51'),
(1826,346,'1',NULL,1414,NULL,NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-11-08 17:10:36','2022-11-08 17:10:36'),
(1838,348,'1',NULL,1428,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE realiza cruzeiro mar&iacute;timo por praias do sudeste brasileiro</strong><br />\r\n<em>O passeio acontecer&aacute; de 26 de fevereiro a 2 de mar&ccedil;o de 2023</em></h1>\r\n\r\n<p>A Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE) est&aacute; promovendo o 2&ordm; Cruzeiro Mar&iacute;timo a bordo do transatl&acirc;ntico MSC Fantasia. Com sa&iacute;da do porto de Santos programada para o dia 26 de fevereiro e retorno no dia 2 de mar&ccedil;o, os passageiros navegar&atilde;o com destino a B&uacute;zios e Ilha Grande.&nbsp;</p>\r\n\r\n<p>Os interessados podem preencher o formul&aacute;rio abaixo, em seguida, ser&atilde;o enviadas a data de inscri&ccedil;&atilde;o e o in&iacute;cio das vendas. Neste momento, ser&aacute; poss&iacute;vel escolher o tipo de cabine, se interna ou com varanda, e conhecer um pouco mais sobre os servi&ccedil;os oferecidos no navio, como o sistema de refei&ccedil;&otilde;es e seguro viagem.&nbsp;</p>\r\n\r\n<p>O investimento parte de R$ 2.810,00 por pessoa, mais a taxa de ades&atilde;o de R$ 100,00, &agrave; vista &ndash; referente &agrave; reserva da cabine. Estes valores s&atilde;o exclusivos para s&oacute;cios e a quantia referente &agrave; escolha do quarto n&atilde;o &eacute; reembols&aacute;vel.</p>\r\n\r\n<p>A viagem &eacute; aberta a n&atilde;o-associados (consulte valores). Para mais informa&ccedil;&otilde;es: cultural@apve.com.br ou mande mensagem para o <a href=\"https://api.whatsapp.com/send?phone=551239255209\">WhatsApp: (12) 3925-5209.</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://forms.office.com/Pages/ResponsePage.aspx?id=Ifz4sf8cEUWMfp8A7WC5yQJMKKwhJj5Imf9EueaySbtUQTVVUFJJTlRFWU1ONjNMRDNGMFoyWkxUMyQlQCN0PWcu\"><strong>FORMUL&Aacute;RIO DE INSCRI&Ccedil;&Atilde;O CRUZEIRO</strong></a></p>\r\n\r\n<p><br />\r\n<strong>Sobre o navio</strong></p>\r\n\r\n<p>O MSC Fantasia &eacute; sofisticado e ecol&oacute;gico, equilibra o aconchego e o conforto com design de &uacute;ltima gera&ccedil;&atilde;o. Na &aacute;rea central, voc&ecirc; encontrar&aacute; uma piazza de pedra completa, com um bar que serve caf&eacute; expresso e doces feitos na hora, al&eacute;m do aut&ecirc;ntico gelato, tornando-o o local perfeito para complementar os momentos de lazer.</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nData: 26 de fevereiro a 2 de mar&ccedil;o de 2023<br />\r\nEmbarque: Porto de Santos<br />\r\nDesembarque: Porto de Santos</p>\r\n\r\n<p><strong>Observa&ccedil;&atilde;o: </strong>O traslado at&eacute; o local de embarque, assim como o de retorno para o local de origem do passageiro (resid&ecirc;ncia), n&atilde;o est&atilde;o inclusos no valor do cruzeiro e devem ser planejados pelo contratante (cliente).&nbsp;Ap&oacute;s o encerramento das vendas a APVE far&aacute; a media&ccedil;&atilde;o da contrata&ccedil;&atilde;o de um &ocirc;nibus e os custos ser&atilde;o repassados aos passageiros atrav&eacute;s da organizadora do grupo.</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"blob:https://apve.com.br/5b30e60b-0bda-4dd2-921a-7bbe0ac3447a\" width=\"1000\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"blob:https://apve.com.br/cedaf8ac-8467-45f1-af4d-8bcd560a911c\" width=\"1000\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-11-11 13:57:00','2022-11-11 13:57:00'),
(1852,358,'1',NULL,1468,'<p>&nbsp;</p>\r\n\r\n<p>Ol&aacute;, associados e frequentadores da APVE.<br />\r\nContamos com a sua ajuda para eleger nossos representantes no Conselho Municipal dos Direitos da Pessoa Idosa.</p>\r\n\r\n<p>S&atilde;o eles:</p>\r\n\r\n<p>&bull;<strong>&nbsp;&nbsp; &nbsp;Representante dos usu&aacute;rios:</strong><br />\r\nPedro Paulo Bunn &ndash; Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE).</p>\r\n\r\n<p><strong>&bull;&nbsp;&nbsp; &nbsp;Representante de entidade abrigo:</strong><br />\r\nCl&aacute;udia C&eacute;sar Castagini e Vanessa Christiane &ndash; Sociedade S&atilde;o Vicente de Paulo (Vicentinos).</p>\r\n\r\n<p><strong>&bull;&nbsp;&nbsp; &nbsp;Representante de entidade n&atilde;o abrigo:</strong><br />\r\nP&eacute;rola Melissa Vianna Braga e Margarida Maranh&atilde;o - OAB &ndash; Ordem dos Advogados do Brasil.</p>\r\n\r\n<p>Data: 30/11/2022 (4&ordf; feira), das 10h &agrave;s 20h<br />\r\nLocal: Casa do Idoso Centro &ndash; Rua Euclides Miragaia, 508, Centro, SJCampos.</p>\r\n\r\n<p><em>*N&atilde;o esque&ccedil;a de levar T&iacute;tulo de Eleitor e documento de identidade.</em><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-11-28 16:43:45','2022-11-28 16:43:45'),
(1856,360,'1',NULL,1581,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>Coral Cantares faz concerto natalino na APVE</strong></h1>\r\n\r\n<p style=\"text-align: center;\"><em><span style=\"font-size:16px;\">Apresenta&ccedil;&atilde;o acontece dia 15 de dezembro, &agrave;s 20h</span></em></p>\r\n\r\n<p>O Sal&atilde;o Ozires Silva da Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE) receber&aacute;, no dia <strong>15 de dezembro</strong>, o Coral Cantares. Em &uacute;nica apresenta&ccedil;&atilde;o, o grupo se exibir&aacute;, &agrave;s 20h, com o &ldquo;Concerto de Natal Solid&aacute;rio&rdquo;.<br />\r\nTrazendo m&uacute;sicas como We are the Champions (Queen) e The Wall (Pink Floyd), o grupo promete agitar a plateia e fazer da noite musical, um dia para ficar guardado na mem&oacute;ria.<br />\r\nO evento, que ser&aacute; aberto ao p&uacute;blico, ter&aacute; ingresso solid&aacute;rio, com a doa&ccedil;&atilde;o dos seguintes alimentos: latas de ervilha, de milho, de sardinha, de atum, de azeitona, maionese, macarr&atilde;o e molho de tomate. A troca pode ser feita na biblioteca da institui&ccedil;&atilde;o nos dias 12, 13 e 14, das 8h30 &agrave;s 18h.</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nData: 15 de dezembro (quinta-feira)<br />\r\nIn&iacute;cio: 20h<br />\r\nTroca de ingressos: biblioteca da APVE<br />\r\nAlimentos solicitados: latas de ervilha, de milho, de sardinha, de atum, de azeitona, maionese, macarr&atilde;o e molho de tomate.<br />\r\nLocal: Sal&atilde;o A da APVE - Al. Candido Marciano Leite, 88, Vila Beth&acirc;nia&nbsp;<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-12-07 14:15:03','2022-12-07 14:15:03'),
(1858,362,'1',NULL,1601,'<h1 style=\"margin-bottom: 11px; text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"margin-bottom: 11px; text-align: center;\"><strong>Mensalidade da APVE ter&aacute; reajuste a partir de 2023</strong></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Anualmente, a APVE reajusta a mensalidade paga por seus associados, levando em considera&ccedil;&atilde;o custos decorrentes da manuten&ccedil;&atilde;o de sua estrutura e de seus servi&ccedil;os ofertados.<br />\r\nAssim, a partir de janeiro de 2023, o valor da mensalidade passar&aacute; para R$ 64,50 (sessenta e quatro reais e cinquenta centavos) e o valor das atividades de nata&ccedil;&atilde;o e hidrogin&aacute;stica ser&atilde;o reajustadas para R$ 30.</p>\r\n\r\n<p>As mensalidades das atividades aqu&aacute;ticas da piscina grande ser&atilde;o enviadas a partir de janeiro de 2023.</p>\r\n\r\n<p>Agradecemos a compreens&atilde;o e estamos &agrave; disposi&ccedil;&atilde;o para quaisquer d&uacute;vidas.</p>\r\n\r\n<p><br />\r\n<strong>Secretaria da APVE</strong><br />\r\nTelefone/WhatsApp: (12) 3925.5200<br />\r\nE-mail: apve@apve.com.br<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-12-11 20:03:22','2022-12-11 20:03:22'),
(1863,366,'1',NULL,1315,'<h1><strong>Fa&ccedil;a a sua ades&atilde;o dos Planos da Santa Casa Sa&uacute;de ainda hoje!</strong></h1>\r\n\r\n<p>Aos que ainda est&atilde;o d&uacute;vida sobre contratar o conv&ecirc;nio Santa Casa Sa&uacute;de, a APVE traz uma novidade: quem fizer a ades&atilde;o at&eacute; o dia 30 de dezembro vai garantir as mesmas condi&ccedil;&otilde;es de car&ecirc;ncia reduzida que foram oferecidas m&ecirc;s passado! At&eacute; esta data, as inclus&otilde;es estar&atilde;o isentas de car&ecirc;ncia, exceto para parto e Doen&ccedil;as ou Les&otilde;es Preexistentes (DLP).</p>\r\n\r\n<p>A ideia &eacute; proporcionar aos associados uma boa rela&ccedil;&atilde;o custo-benef&iacute;cio e, assim, estender os cuidados que eles j&aacute; recebem em nossa unidade at&eacute; fora dos port&otilde;es! Afinal, a sa&uacute;de &eacute; um dos pilares mais representativos de nossa institui&ccedil;&atilde;o.</p>\r\n\r\n<p>Para aderir, &eacute; necess&aacute;rio que o contratante seja funcion&aacute;rio ou ex-funcion&aacute;rio da Embraer (e associado &agrave; APVE). Os dependentes tamb&eacute;m s&atilde;o beneficiados. Em caso de d&uacute;vidas, entre em contato com a secretaria de conv&ecirc;nios da institui&ccedil;&atilde;o pelos telefones (12) 3925-5205/3925-5213 ou por e-mail: convenios@apve.com.br.&nbsp;</p>\r\n\r\n<p>N&atilde;o perca essa oportunidade! Voc&ecirc; e sua fam&iacute;lia merecem os servi&ccedil;os do Santa Casa Sa&uacute;de junto com as vantagens que s&oacute; o associado da APVE pode ter.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-12-16 11:33:30','2022-12-16 11:33:30'),
(1871,367,'1',NULL,1915,'<h1>&nbsp;</h1>\r\n\r\n<h1><strong>Confira o expediente da APVE neste fim de ano 2022/2023</strong></h1>\r\n\r\n<p><span style=\"font-size:18px;\"><em>APVE tem hor&aacute;rio especial de funcionamento em dezembro</em></span></p>\r\n\r\n<p>O m&ecirc;s das festas chegou e, junto com ele, uma grade de hor&aacute;rios especial.&nbsp;<br />\r\nConfiram os dias de funcionamento de cada setor:</p>\r\n\r\n<p><strong>ACADEMIA</strong><br />\r\n&nbsp;Na sexta-feira, dia 23 de dezembro, a academia fechar&aacute; &agrave;s 11h.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Aberta nos dias 27, 28, 29 das 8h &agrave;s 18h.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;No dia 30 aberta das 8h &agrave;s 12h.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Fechada nos dias 24, 25, 26, 31 de dezembro, 01 e 02 de janeiro de 2023.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Funcionamento normal a partir do dia 03 de janeiro de 2023.<br />\r\n&nbsp;<br />\r\n<strong>SECRETARIA E FARM&Aacute;CIA</strong><br />\r\n&nbsp;Na sexta-feira, dia 23 de dezembro, a secretaria e farm&aacute;cia fechar&atilde;o &agrave;s 11h.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Abertas nos dias 27, 28, 29, 30, das 8h &agrave;s 18h.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Fechada nos dias 24, 25, 26, 31 de dezembro, 1 e 02 de janeiro.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Funcionamento normal a partir do dia 03 de janeiro de 2023.<br />\r\n<strong>&nbsp;<br />\r\nPISCINA</strong><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Aberta nos dias 27, 28, 29, 30 de dezembro, das 9h &agrave;s 17h (uso livre).<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Fechada nos dias 23, 24, 25, 26, 31 de dezembro, 01 e 02 de janeiro de 2023.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Funcionamento normal a partir do dia 03 de janeiro de 2023.<br />\r\n&nbsp;<br />\r\n<strong>SAUNA E SAL&Atilde;O DE JOGOS</strong><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Aberta nos dias 27, 28, 29, 30 de dezembro das 8h &agrave;s 18h.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Fechada nos dias 23, 24, 25, 26, 31 de dezembro, 01 e 02 de janeiro de 2023.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Funcionamento normal a partir do dia 03 de janeiro de 2023.<br />\r\n&nbsp;<br />\r\n<strong>AVIDADES CULTURAIS E DE ESPORTES E LAZER</strong><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Conforme o combinado com cada professor da &aacute;rea.</p>\r\n\r\n<p><em>Desejamos a todos um maravilhoso Natal e um Feliz Ano-Novo!</em><br />\r\n<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-12-19 17:09:32','2022-12-19 17:09:32'),
