(1879,300,'1',NULL,1117,'<p>No dia 22 de setembro, aconteceu o evento &ldquo;A&ccedil;&atilde;o Sa&uacute;de APVE&rdquo;, que teve como inten&ccedil;&atilde;o dar destaque ao Setembro Amarelo, ressaltando a import&acirc;ncia do cuidado com a Sa&uacute;de Mental e a preven&ccedil;&atilde;o ao Suic&iacute;dio.</p>\r\n\r\n<p>O evento contou com a animada presen&ccedil;a do projeto Colher e tamb&eacute;m, com os representantes do CVV, presentes ao longo dia para bate-papo e esclarecimento de d&uacute;vidas</p>\r\n\r\n<p>Estiveram presentes tamb&eacute;m parceiros, associados e comunidade, que puderam desfrutar de v&aacute;rias atividades durante o dia, como: palestras, massagens, sess&otilde;es de atividades f&iacute;sicas e ao final a exibi&ccedil;&atilde;o do filme &ldquo; Por Lugares Incr&iacute;veis&rdquo;</p>\r\n\r\n<p>E o mais importante, puderam tirar um tempo para se informar sobre qu&atilde;o importante &eacute; o cuidado com a sa&uacute;de mental, e tamb&eacute;m, olhar para si. Al&eacute;m disso, 200 mudas de plantas, que simbolizam a vida, foram entregues para os associados e frequentadores.</p>\r\n\r\n<p>E lembrando, sempre que se sentir mal, fale com algu&eacute;m, respire, e caso esteja muito dif&iacute;cil, ligue para o #188.</p>\r\n\r\n<p>Gostar&iacute;amos de agradecer a todos que se dispuseram em participar desse evento, em especial, aos nossos parceiros, que tornaram o evento mais din&acirc;mico e rico em conhecimento, muito obrigado!</p>\r\n\r\n<p>O A&ccedil;&atilde;o Sa&uacute;de contou com a colabora&ccedil;&atilde;o de: Unimed, CVV, Unip, Massagem e Acupuntura Vanessa Assis, Farm&aacute;cia Drogaria Raia, grupo de corrida da APVE, Daiana Carvalho e Sidney Eleut&eacute;rio.</p>',NULL,3,'col-sm-10','none',NULL,'col-sm-12',NULL,NULL,'2022-12-27 17:21:28','2022-12-27 17:21:28'),
