(1886,372,'1',NULL,1393,'<h1>&nbsp;</h1>\r\n\r\n<h1><strong>Confira as datas de retorno das atividades</strong></h1>\r\n\r\n<p>Se voc&ecirc; participa de uma atividade Cultural ou Esportes e Lazer, fique atento ao retorno das aulas em 2023!&nbsp;</p>\r\n\r\n<p><br />\r\nNata&ccedil;&atilde;o e Hidrogin&aacute;stica.......................10/jan<br />\r\nArtesanato .............................................01/fev<br />\r\nBallet adulto...........................................31/jan<br />\r\nBallet infantil...........................................31/jan<br />\r\nCh&aacute; com Arte..........................................18/fev<br />\r\nCine Clube..............................................26/jan<br />\r\nClube de Leitura.....................................02/mar<br />\r\nCoral Cantares.......................................02/fev<br />\r\nCorte e costura.......................................07/fev<br />\r\nCostura Criativa......................................07/fev<br />\r\nDan&ccedil;a de Sal&atilde;o......................................09/jan<br />\r\nIngl&ecirc;s......................................................16/jan<br />\r\nMusicaliza&ccedil;&atilde;o.........................................01/fev<br />\r\nPintura....................................................16/jan<br />\r\nTeclado e Piano&nbsp;.....................................01/fev<br />\r\nViol&atilde;o......................................................02/jan<br />\r\nJovens de Cora&ccedil;&atilde;o/sapateado...............23/jan<br />\r\nPalha&ccedil;aria..............................................16/jan</p>\r\n\r\n<p>Em caso de d&uacute;vidas, envia-nos uma mensagem no <a href=\"https://api.whatsapp.com/send?phone=551239255209\">WhatsApp (12) 3925-5209</a> para atividades Culturais e <a href=\"https://api.whatsapp.com/send?phone=551239255215\">(12) 3925-5215</a> para atividades de Esporte e Lazer.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-12-28 15:22:05','2022-12-28 15:22:05'),
(1894,211,'1',NULL,825,'<p class=\"MsoNoSpacing\"><span style=\"color:#8e44ad;\"><span style=\"font-size:48px;\"><span style=\"font-family:Calibri,sans-serif\"><b>Hor&aacute;rio de Funcionamento </b></span></span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"color:#95a5a6;\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><i>*O hor&aacute;rio de funcionamento pode ser altera&ccedil;&otilde;es nos feriados, consulte em not&iacute;cias ou nas redes sociais.</i></span></span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Secretaria:</b> de segunda a sexta, das 8h &agrave;s 17h30.</span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Piscina Grande</b><br />\r\n<b>Hor&aacute;rios para lazer:</b><br />\r\nSab e Dom: das 9h &agrave;s 17h<br />\r\nTer a Sex: das 9h &agrave;s 21h </span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><i><span style=\"color:#767171\">*Segunda-feira as piscinas s&atilde;o fechadas para manuten&ccedil;&atilde;o.</span></i></span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Academia</b><br />\r\nSeg a Sex: das 6h &agrave;s 21h<br />\r\nS&aacute;b: das 8h &agrave;s 12h</span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Sal&atilde;o de Jogos</b><br />\r\nSeg a Sex: das 9h &agrave;s 21h<br />\r\nS&aacute;b e Dom: das 9h &agrave;s 17h</span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Estacionamento</b><br />\r\nSeg a Sex: das 6h &agrave;s 22h<br />\r\nS&aacute;b e Dom: das 8h &agrave;s 17h</span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size:22px;\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Farm&aacute;cia Comunit&aacute;ria</b><br />\r\nSeg a sex: das 8h &agrave;s 12h e das 13h &agrave;s 17h45</span></span></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;</p>\r\n\r\n<p><span style=\"font-size:22px;\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\"><b>&bull; Sauna</b></span></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"blob:https://apve.com.br/eabe6ed3-de09-4151-b8c9-804934512591\" width=\"3508\" />\r\n<figcaption></figcaption>\r\n</figure>',NULL,3,'col-sm-12','right','col-sm-12',NULL,NULL,NULL,'2022-12-29 14:37:00','2022-12-29 14:37:00'),
(1925,380,'1',NULL,2098,'<h2>&nbsp;</h2>\r\n\r\n<h2><strong>A APVE continua em seu processo de melhoria cont&iacute;nua</strong></h2>\r\n\r\n<p style=\"text-align: justify;\">Com a implementa&ccedil;&atilde;o de um novo sistema de gest&atilde;o, inicia este m&ecirc;s de dezembro na APVE, o novo envio de boletos. A partir de hoje (29/12), ser&atilde;o enviados os boletos diretamente e automaticamente para o e-mail do associado cadastrado em nosso sistema, referente ao m&ecirc;s seguinte.</p>\r\n\r\n<p style=\"text-align: justify;\">O envio dos boletos pelos correios tamb&eacute;m permanecer&aacute;. Em caso de d&uacute;vidas entre em contato com nossos atendentes pelo telefone ou WhatsApp <a href=\"https://api.whatsapp.com/send?phone=551239255200\">(12) 3925-5200 </a>ou pelo email apve@apve.com.br &nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2022-12-29 17:49:20','2022-12-29 17:49:20'),
(1936,381,'1',NULL,2108,'<h1>&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>Laborat&oacute;rio Unimed realizar&aacute; exames na APVE</strong><br />\r\n<em>A&ccedil;&atilde;o acontece toda &uacute;ltima quinta-feira do m&ecirc;s</em></h1>\r\n\r\n<p style=\"text-align: justify;\">Oferecer uma pausa na correria do dia a dia para cuidar um pouco mais da sa&uacute;de. Este &eacute; o objetivo da Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE) que, em parceria com a Unimed, realizar&aacute; exames laboratoriais no pr&oacute;ximo dia 26, das 7h30 &agrave;s 9h30 na pr&oacute;pria Institui&ccedil;&atilde;o. A iniciativa ser&aacute; repetida em toda &uacute;ltima quinta-feira dos meses seguintes.</p>\r\n\r\n<p style=\"text-align: justify;\">Para participar, o associado (que j&aacute; seja assistido pela Unimed) deve agendar o servi&ccedil;o pelo e-mail: lab.agendamento@unimedsjc.coop.br e, no dia marcado, levar o pedido m&eacute;dico. Os atendimentos ser&atilde;o na sala de exames da APVE, localizado na rampa de acesso &agrave; academia.</p>\r\n\r\n<p style=\"text-align: justify;\">Esta &eacute; mais uma a&ccedil;&atilde;o que visa o bem-estar dos associados, proporcionando conforto e levando facilidades para a rotina daqueles que frequentam a Institui&ccedil;&atilde;o.<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n<strong>Servi&ccedil;o:</strong></p>\r\n\r\n<p>A&ccedil;&atilde;o: exames laboratoriais<br />\r\nDia e hora: 26 de janeiro, das 7h30 &agrave;s 9h30<br />\r\nP&uacute;blico-alvo: associados<br />\r\nOnde: sala de exames da APVE (pr&oacute;ximo a rampa da academia)<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-03 16:05:51','2023-01-03 16:05:51'),
(1945,208,'1',NULL,NULL,'<p>Para ser um associado APVE temos as seguintes classifica&ccedil;&otilde;es:</p>\r\n\r\n<ul>\r\n	<li><strong>Associado Especial: </strong>pessoas que atuaram e tenham 05 anos de carteira registrados como funcion&aacute;rio Embraer.</li>\r\n	<li><strong>Associado Aspirante:</strong> pessoas que atuaram ou atuam e tenham 10 anos de carteira registrados como funcion&aacute;rio Embraer.</li>\r\n	<li><strong>Associado Veterano: </strong>pessoas que atuaram ou atuam e tenham 15 anos registrados como funcion&aacute;rio Embraer.<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p>N&atilde;o &eacute; necess&aacute;rio estar trabalhando no momento, basta comprovar o per&iacute;odo trabalhado, mesmo que n&atilde;o tenha sido realizado ininterruptamente.</p>\r\n\r\n<p>Caso se encaixe no perfil, preencha o pr&eacute;-cadastro abaixo, nos envie a c&oacute;pia dos documentos (em formato PDF) e dirija-se a sede da APVE ou ao nosso escrit&oacute;rio na Unidade Faria Lima (Ozires Silva) e assine sua solicita&ccedil;&atilde;o. Ou se preferir poder&aacute; escanear e nos enviar a ficha preenchida &nbsp;e assinada por email.<br />\r\nAs c&oacute;pias dos documentos poder&atilde;o ser enviados tamb&eacute;m via e-mail, no seguinte endere&ccedil;o eletr&ocirc;nico: cadastro@apve.com.br.</p>\r\n\r\n<p><br />\r\nDocumentos:<br />\r\n1. CPF e RG (Titular e C&ocirc;njuge);<br />\r\n2. Certid&atilde;o de Casamento;<br />\r\n3. Comprovante de Endere&ccedil;o;<br />\r\n4. Carteira Profissional (p&aacute;gina da foto frente e verso e registro da Embraer contendo n&uacute;mero da chapa);<br />\r\n5. RG ou Certid&atilde;o de Nascimento dos Filhos menores de 21 anos, se houver;<br />\r\n6. RG, CPF e Comprovante Universit&aacute;rio para filhos maiores de 21 anos, se houver;</p>\r\n\r\n<p>Obs.: caso tenha filhos maiores de 21 anos que queiram se associar e n&atilde;o estejam cursando n&iacute;vel superior, os mesmos poder&atilde;o associar-se como Contribuintes. &Eacute; necess&aacute;rio o envio do RG, CPF e Comprovante de Endere&ccedil;o. A mensalidade destes ser&aacute; cobrada individualmente.</p>\r\n\r\n<p>Forma de Pagamento das Mensalidades:<br />\r\n- Via desconto em folha de pagamento, para os funcion&aacute;rios ativos na Embraer (exceto Associado Contribuinte);<br />\r\n- Via boleto.</p>\r\n\r\n<p>Valor da mensalidade: <strong>R$ 64,50</strong> (valor atualizado em 2023).</p>\r\n\r\n<p>Para maiores informa&ccedil;&otilde;es ligue <a href=\"https://api.whatsapp.com/send?phone=551239255200\">(12) 3925-5200 (WhatsApp)</a><br />\r\n&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary btn-lg\" download=\"\" href=\"https://apve.com.br/uploads/pdf/1659634031-ficha-cadastral-apve.pdf\" target=\"_blank\">FICHA CADASTRAL</a></p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-06 09:52:13','2023-01-06 09:52:13'),
(1955,376,'1',NULL,NULL,'<p>Laborat&oacute;rio Unimed &eacute; uma parceria entre a Unimed e a APVE.<br />\r\nToda &uacute;ltima quinta-feira do m&ecirc;s, o Laborat&oacute;rio da Unimed ir&aacute; fazer as coletas aqui na APVE, na sala de exames para associados, facilitando para todos os frequentadores.&nbsp;</p>\r\n\r\n<p>Primeiro laborat&oacute;rio ser&aacute; no dia 26/01 (quinta-feira), das 7h30 &agrave;s 9h30. N&atilde;o ser&aacute; necess&aacute;rio agendamento.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-06 15:06:06','2023-01-06 15:06:06'),
(1960,384,'1',NULL,2130,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE abre novas turmas de Musicaliza&ccedil;&atilde;o infantil e de Ingl&ecirc;s para adultos e adolescentes</strong><br />\r\n&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><em>Inscri&ccedil;&otilde;es j&aacute; est&atilde;o abertas e seguem at&eacute; 1&ordm; de fevereiro</em></h1>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\nA APVE abre inscri&ccedil;&otilde;es para as turmas de musicaliza&ccedil;&atilde;o infantil (n&iacute;vel iniciante) e de ingl&ecirc;s (n&iacute;veis b&aacute;sico e intermedi&aacute;rio, tanto para adolescentes quanto para adultos). A matr&iacute;cula deve ser feita na biblioteca da institui&ccedil;&atilde;o at&eacute; o in&iacute;cio das aulas, em 1&ordm; de fevereiro de 2023.</p>\r\n\r\n<p style=\"text-align: justify;\">As aulas de musicaliza&ccedil;&atilde;o infantil atendem crian&ccedil;as de 6 a 7 anos, ensinando-as a Flauta Pedag&oacute;gica e os instrumentos de bandinha. Os encontros acontecem &agrave;s quartas-feiras, das 18h30 &agrave;s 19h30, na APVE.</p>\r\n\r\n<h3 style=\"text-align: justify;\">&nbsp;</h3>\r\n\r\n<h3 style=\"text-align: justify;\"><span style=\"color:#2980b9;\"><strong>Musicaliza&ccedil;&atilde;o iniciante</strong></span></h3>\r\n\r\n<p style=\"text-align: justify;\">6 a 7 anos (Flauta Pedag&oacute;gica e instrumentos de bandinha)<br />\r\nQuarta-feira, das 18h30 &agrave;s 19h30</p>\r\n\r\n<p style=\"text-align: justify;\">Professora: Mari&acirc;ngela Canelas Davoli<br />\r\nAssociados da APVE - R$ 30,00<br />\r\nN&atilde;o Associados da APVE - R$ 45,00</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\nAos que desejam aprender um outro idioma, a APVE abriu turmas de ingl&ecirc;s, com n&iacute;veis b&aacute;sico e intermedi&aacute;rio, para adolescentes e adultos.&nbsp;</p>\r\n\r\n<h3 style=\"text-align: justify;\">&nbsp;</h3>\r\n\r\n<h3 style=\"text-align: justify;\"><span style=\"color:#3498db;\"><strong>Aulas de ingl&ecirc;s</strong></span></h3>\r\n\r\n<p style=\"text-align: justify;\">&bull;&nbsp;&nbsp; &nbsp;Ingl&ecirc;s b&aacute;sico adulto &ndash; 2&ordf; e 4&ordf;, das 10h &agrave;s 10h50.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Ingl&ecirc;s b&aacute;sico adulto &ndash; 2&ordf; e 4&ordf;, das 15h &agrave;s 15h50.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Ingl&ecirc;s b&aacute;sico adolescentes (13 a 17 anos) &ndash; 2&ordf; e 4&ordf;, das 16h &agrave;s 16h50.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Ingl&ecirc;s intermedi&aacute;rio adulto &ndash; 3&ordf; e 5&ordf;, das 17h &agrave;s 17h50.</p>\r\n\r\n<p style=\"text-align: justify;\">Professora: Maria Regina<br />\r\nMatr&iacute;cula: R$ 50,00<br />\r\nMensalidade: R$ 150,00 associado APVE / R$ 180,00 n&atilde;o associado da APVE</p>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\nPara mais informa&ccedil;&otilde;es entre em contato com o setor cultural da APVE atrav&eacute;s do telefone ou <a href=\"https://api.whatsapp.com/send?phone=551239255209\">WhatsApp (12) 3925-5209.&nbsp;</a></p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Servi&ccedil;o:</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Abertura de vagas<br />\r\nMatr&iacute;cula: at&eacute; 1&ordm; de fevereiro<br />\r\nLocal: APVE<br />\r\nInforma&ccedil;&otilde;es: (12) 3925-5209<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-09 17:44:02','2023-01-09 17:44:02'),
(1966,217,'1',NULL,835,'<h4 style=\"text-align: center;\">&nbsp;</h4>\r\n\r\n<h2 style=\"text-align: center;\"><strong>Associado APVE, garanta j&aacute; seu conv&ecirc;nio Unimed e usufrua dos diversos benef&iacute;cios para sua sa&uacute;de</strong></h2>\r\n\r\n<p>A maior rede m&eacute;dica, a Unimed, tem parceria consolidada com a nossa associa&ccedil;&atilde;o para oferecer os melhores servi&ccedil;os em sa&uacute;de e cuidados para voc&ecirc; e sua fam&iacute;lia. Sendo associado, al&eacute;m do plano m&eacute;dico voc&ecirc; tamb&eacute;m garante diversos benef&iacute;cios e todo suporte, oferecido pela APVE, confira:</p>\r\n\r\n<ul>\r\n	<li>Autoriza&ccedil;&atilde;o de guias de exames, cirurgias e outros procedimentos;</li>\r\n	<li>Agendamento de consultas e exames;</li>\r\n	<li>Acompanhamento do associado/ conveniado ao servi&ccedil;o social da Unimed para esclarecimentos de d&uacute;vidas ou reclama&ccedil;&otilde;es.</li>\r\n	<li>Acompanhamento do associado/ conveniado ao servi&ccedil;o social do NAIS (n&uacute;cleo de aten&ccedil;&atilde;o integral a sa&uacute;de) para entrada e acompanhamento de Home Care e outros programas como gesto e p&eacute; diab&eacute;tico.</li>\r\n	<li>Visitas hospitalares, bem como a ida para resolu&ccedil;&atilde;o de problemas com a interna&ccedil;&atilde;o.&nbsp;</li>\r\n	<li>Empr&eacute;stimo de materiais de apoio como muletas, cadeiras de rodas, andadores e muito mais!</li>\r\n	<li>Aquisi&ccedil;&atilde;o de medicamentos gratuitos na Farm&aacute;cia da APVE.</li>\r\n</ul>\r\n\r\n<p>Adquira seu plano hoje e garanta a sa&uacute;de e a seguran&ccedil;a que voc&ecirc; e sua fam&iacute;lia merecem. Ligue para o setor de conv&ecirc;nios da APVE e saiba mais. Telefones: (12) 3925-5205 (WhatsApp) / 3925-5213.</p>\r\n\r\n<p>Se voc&ecirc; n&atilde;o &eacute; associado APVE, mas trabalha na Embraer h&aacute; mais de 10 anos j&aacute; pode se associar e tamb&eacute;m aproveitar de tudo o que nosso clube tem a lhe oferecer! Conhe&ccedil;a mais da APVE em www.apve.com.br ou ligue (12) 3925-5200.&nbsp;</p>\r\n\r\n<h4><br />\r\n&nbsp;</h4>',NULL,3,'col-sm-12','right','col-sm-12','col-sm-12',NULL,NULL,'2023-01-10 11:36:21','2023-01-10 11:36:21'),
(1967,217,'1',NULL,838,'<h4>&nbsp;</h4>\r\n\r\n<h4>NAIS - N&Uacute;CLEO DE ATEN&Ccedil;&Atilde;O INTEGRAL &Agrave; SA&Uacute;DE DA UNIMED</h4>\r\n\r\n<p>O NAIS &eacute; o Nucleo respons&aacute;vel pela gest&atilde;o da medicina preventiva da unimed em S&atilde;o Jos&eacute; dos Campos.</p>\r\n\r\n<p>Criado em 2006 pela Unimed- SJC com o intuito de adotar medidas de promo&ccedil;&atilde;o a sa&uacute;de e preven&ccedil;&atilde;o de doen&ccedil;as, desenvolve programas que proporcionam mais qualidade de vida sa&uacute;de e bem-estar aos conveniados.</p>\r\n\r\n<p>Com profissionais atuantes nas &aacute;reas de Psicologia e Fonoaudiologia, Nutri&ccedil;&atilde;o, Enfermagem, Assist&ecirc;ncia Social, Fisioterapia e Educa&ccedil;&atilde;o F&iacute;sica, apresenta programas divididos em quatro seguimentos:</p>\r\n\r\n<ul>\r\n	<li>Sa&uacute;de da Crian&ccedil;a e Adolescente</li>\r\n	<li>Sa&uacute;de do Adulto e do Idoso</li>\r\n	<li>Sa&uacute;de da Mulher</li>\r\n	<li>Sa&uacute;de Mental</li>\r\n</ul>\r\n\r\n<p>O Servi&ccedil;o Social da APVE possui um canal direto com o Nais (N&uacute;cleo de Aten&ccedil;&atilde;o Integral a Sa&uacute;de), para orienta&ccedil;&atilde;o e encaminhamento aos servi&ccedil;os prestados citados acima.</p>\r\n\r\n<p>Apenas para participar dos programas de reabilita&ccedil;&atilde;o em coluna e grupo especializado em tratamento de obesidade &eacute; necess&aacute;rio a indica&ccedil;&atilde;o de um m&eacute;dico credenciado.</p>\r\n\r\n<p>Em caso de d&uacute;vidas entre em contato com as nossas assistentes sociais ou com o nosso setor de Conv&ecirc;nios.</p>\r\n\r\n<p>&nbsp;</p>',NULL,4,'col-sm-12','right','col-sm-12','col-sm-12',NULL,NULL,'2023-01-10 11:36:21','2023-01-10 11:36:21'),
(1968,217,'1',NULL,839,'<h4 style=\"text-align: center;\"><strong>Confira a Tabela de Valores</strong></h4>\r\n\r\n<p>&nbsp;</p>',NULL,5,'col-sm-12','right','col-sm-12','col-sm-12',NULL,'mt-5','2023-01-10 11:36:21','2023-01-10 11:36:21'),
(2146,203,'1',NULL,NULL,'<p>Em sua estrutura a APVE disponibiliza sal&otilde;es, audit&oacute;rio e outros espa&ccedil;os modernos para grandes eventos particulares e corporativos.<br />\r\nConfira a nossa tabela de valores e venha conhecer nossas acomoda&ccedil;&otilde;es.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,'col-sm-12',NULL,NULL,'2023-01-10 16:09:12','2023-01-10 16:09:12'),
(2147,203,'1',NULL,NULL,'<h2>Sal&atilde;o Ozires Silva</h2>\r\n\r\n<p>Capacidade: 360 pessoas | 90 mesas | 360 cadeiras<br />\r\n3 freezers / fog&atilde;o industrial com g&aacute;s encanado<br />\r\n&nbsp;</p>\r\n\r\n<div class=\"table-responsive\">\r\n<table cellpadding=\"5\" cellspacing=\"0\" class=\"table table-striped\" style=\"max-width:500px\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"155\"><strong>Dura&ccedil;&atilde;o: 1 dia</strong></td>\r\n			<td width=\"155\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Sex | S&aacute;b | Dom</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 3.575,00&nbsp;</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 5.335,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 3.900,00&nbsp;</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 5.850,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Seg a Qui</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 3.245,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 4.565,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 3.550,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 5.000,00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>',NULL,4,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2023-01-10 16:09:12','2023-01-10 16:09:12'),
(2148,203,'1',NULL,NULL,'<h2>&nbsp;</h2>\r\n\r\n<h2>Audit&oacute;rio</h2>\r\n\r\n<p>Capacidade: 60 lugares<br />\r\nEquipamento de som com microfone | Flip Chart<br />\r\nProjetor | Ar condicionado<br />\r\n&nbsp;</p>\r\n\r\n<div class=\"table-responsive\">\r\n<table cellpadding=\"5\" cellspacing=\"0\" class=\"table table-striped\" style=\"max-width:500px\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"2\"><strong>Dura&ccedil;&atilde;o: 4 horas&nbsp;</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td width=\"155\">&nbsp;</td>\r\n			<td width=\"155\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 385,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 550,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 385,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 550,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\"><strong>Dura&ccedil;&atilde;o: 8 horas</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 495,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 660,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 495,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 660,00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table cellpadding=\"5\" cellspacing=\"0\" class=\"table table-striped\" style=\"max-width:500px\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"2\"><strong>Dura&ccedil;&atilde;o: 12 horas</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 605,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 770,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 605,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 770,00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>',NULL,5,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-10 16:09:12','2023-01-10 16:09:12'),
(2149,203,'1',NULL,NULL,'<h2>&nbsp;</h2>\r\n\r\n<h2>Sala de Proje&ccedil;&atilde;o</h2>\r\n\r\n<p>Capacidade: 20 lugares | Projetor e som<br />\r\n&nbsp;</p>\r\n\r\n<div class=\"table-responsive\">\r\n<table cellpadding=\"5\" cellspacing=\"0\" class=\"table table-striped\" style=\"max-width:500px\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"155\"><strong>Dura&ccedil;&atilde;o: 4hrs</strong></td>\r\n			<td width=\"155\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 715,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 880,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 715,00&nbsp;</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 880,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Dura&ccedil;&atilde;o: 8hrs</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2023 - Assoc.: R$ 1.430,00</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 1.760,00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2024 - Assoc.: R$ 1.430,00&nbsp;</td>\r\n			<td>&nbsp;N&atilde;o Assoc.: R$ 1.760,00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>',NULL,6,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-10 16:09:12','2023-01-10 16:09:12'),
(2150,203,'1',NULL,NULL,'<h3 style=\"text-align: center;\">&nbsp;</h3>\r\n\r\n<h4 style=\"text-align: center;\">- Qualquer pessoa pode alugar um sal&atilde;o da APVE, associado ou n&atilde;o.<br />\r\n- O contrato deve ser feito at&eacute; o 5&deg; dia &uacute;til da data da reserva.</h4>\r\n\r\n<p style=\"text-align: center;\">Agendamentos na <strong>secretaria da APVE</strong> atrav&eacute;s do telefone <strong>(12) 3925-5200</strong> (WhatsApp) ou pelo <strong>apve@apve.com.br&nbsp;</strong><br />\r\n&nbsp;</p>','#F3F3F3',7,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2023-01-10 16:09:12','2023-01-10 16:09:12'),
(2233,386,'1',NULL,2139,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE promove aula experimental de sapateado para p&uacute;blico 45+</strong><br />\r\n<em>Aula gratuita acontece dia 31 de janeiro, &agrave;s 17h</em></h1>\r\n\r\n<p style=\"text-align: justify;\">Promover um estado de disposi&ccedil;&atilde;o f&iacute;sica, mental e social, contribuindo para a melhora da qualidade de vida. Este &eacute; o objetivo das aulas de sapateado para o p&uacute;blico 45+, promovidas pela Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE), em parceria com o Instituto Jovens de Cora&ccedil;&atilde;o - Arte &amp; Longevidade. E para que a popula&ccedil;&atilde;o possa conhecer esta modalidade, acontecer&aacute; uma aula experimental, no dia 31 de janeiro, &agrave;s 17h, com a professora Aline Carneiro.<br />\r\nA aula ser&aacute; gratuita e aberta a todos os jovens adultos que gostem de dan&ccedil;a e que se interessem em aprender uma nova forma de movimento corporal. Para participar, basta se inscrever no link abaixo e, no dia, vir com roupas confort&aacute;veis e trazer um par de sapatos que tenha sola lisa (neste momento, n&atilde;o ser&aacute; necess&aacute;rio comprar o cal&ccedil;ado espec&iacute;fico do sapateado).<br />\r\nAos que se interessarem em se inscrever para as aulas regulares, elas acontecer&atilde;o toda ter&ccedil;a e quinta, conforme n&iacute;veis e hor&aacute;rios a seguir: Iniciante: das 18h &agrave;s 19h; Intermedi&aacute;rio: das 17h &agrave;s 18h. As inscri&ccedil;&otilde;es para as aulas poder&atilde;o ser feitas na biblioteca da apve.<br />\r\nEsta iniciativa busca a inclus&atilde;o de pessoas mais maduras em atividades diversas, especialmente na dan&ccedil;a, fazendo-as, por meio da arte, sentirem-se parte de algo socialmente relevante.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><a class=\"btn btn-primary\" href=\"http://forms.office.com/r/rFvurM3Ygi\">Inscreva-se aqui na aula experimental</a></p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nAula experimental gratuita de sapateado<br />\r\nData: 31 de janeiro<br />\r\nIn&iacute;cio: 17h<br />\r\nLocal: Sal&atilde;o D da APVE - Al. Candido Marciano Leite, 88, Vila Beth&acirc;nia&nbsp;<br />\r\nAulas regulares: Iniciante: das 18h &agrave;s 19h; Intermedi&aacute;rio: das 17h &agrave;s 18h.&nbsp;<br />\r\nMensalidade: Associado APVE: R$ 150,00 / N&atilde;o Associado APVE: R$ 180,00<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-11 17:44:29','2023-01-11 17:44:29'),
