gratuita de sapateado<br />\r\nData: 31 de janeiro<br />\r\nIn&iacute;cio: 17h<br />\r\nLocal: Sal&atilde;o D da APVE - Al. Candido Marciano Leite, 88, Vila Beth&acirc;nia&nbsp;<br />\r\nAulas regulares: Iniciante: das 18h &agrave;s 19h; Intermedi&aacute;rio: das 17h &agrave;s 18h.&nbsp;<br />\r\nMensalidade: Associado APVE: R$ 150,00 / N&atilde;o Associado APVE: R$ 180,00</p>',NULL,3,NULL,'right','col-sm-5','col-sm-12',NULL,NULL,'2023-01-11 17:52:01','2023-01-11 17:52:01'),
(2271,389,'1',NULL,NULL,'<h3><strong>Psican&aacute;lise &amp; Cinema na APVE</strong></h3>\r\n\r\n<p><br />\r\nDia: 26 de janeiro &agrave;s 19h<br />\r\nLocal: Cine Cultural M&aacute;rio Leme Galv&atilde;o &ndash; ao lado da biblioteca da APVE<br />\r\nBilheteria: 1kg de alimento n&atilde;o perec&iacute;vel<br />\r\nFilme: &nbsp;Matilda: O Musical<br />\r\nDura&ccedil;&atilde;o: 1h56m<br />\r\nFaixa et&aacute;ria: maior de 16 anos<br />\r\nTema abordado: O Musical Matilda &eacute; um convite para pensarmos juntos sobre a constru&ccedil;&atilde;o de v&iacute;nculos, confiabilidade, e o papel da fam&iacute;lia &nbsp;e escola na constitui&ccedil;&atilde;o do EU.<br />\r\nMedia&ccedil;&atilde;o: Cl&aacute;udia Del Corto, Francisco Marins e Thomaz Barone da APVP &ndash; Associa&ccedil;&atilde;o de Psicanalistas do Vale do Para&iacute;ba.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://forms.office.com/r/HxNM4Rdp0C\">Clique aqui e fa&ccedil;a a sua inscri&ccedil;&atilde;o</a><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,'col-sm-12',NULL,NULL,'2023-01-13 15:28:15','2023-01-13 15:28:15'),
(2278,392,'1',NULL,2149,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE confere atra&ccedil;&otilde;es da Festa da Uva de Jundia&iacute;&nbsp;</strong><br />\r\n<em>Evento est&aacute; na 38&ordf; edi&ccedil;&atilde;o e traz apresenta&ccedil;&otilde;es art&iacute;sticas, exposi&ccedil;&atilde;o de produtos e muito mais</em></h1>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">No dia 4 de fevereiro, &agrave;s 8h, a Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE) realizar&aacute; um passeio at&eacute; a cidade de Jundia&iacute;, local onde acontece a 38&ordf; edi&ccedil;&atilde;o da Festa da Uva. Este ano, a celebra&ccedil;&atilde;o ocorre de 12 de janeiro a 5 de fevereiro.</p>\r\n\r\n<p style=\"text-align: justify;\">O evento &eacute; uma tradi&ccedil;&atilde;o na cidade, que surgiu em 1934 e segue at&eacute; os dias atuais &ndash; n&atilde;o tendo sido realizado em alguns per&iacute;odos da hist&oacute;ria, como durante a 2&ordf; Guerra Mundial e na pandemia da COVID-19. Como parte da programa&ccedil;&atilde;o haver&aacute; apresenta&ccedil;&otilde;es musicais e culturais, interven&ccedil;&otilde;es art&iacute;sticas, brincadeiras, pinturas faciais e a aguardada pisa da uva. Nesta atividade, o grupo Folklor&iacute;stico Stella Bianca convida o p&uacute;blico a macerar as uvas usando os p&eacute;s, ao som de m&uacute;sicas italianas.</p>\r\n\r\n<p style=\"text-align: justify;\">Com o objetivo de quebrar a rotina e apresentar novos lugares, sabores e aromas, o passeio promete um dia de atividades descontra&iacute;das e elucidativas, apresentando um pouco da cultura da cidade. Para participar, basta se inscrever pelo telefone da Diretoria de Eventos 3925-5215 &ndash; esse n&uacute;mero tamb&eacute;m &eacute; whatsapp &ndash; e realizar o pagamento de R$ 80 (s&oacute;cios) ou R$ 100 (n&atilde;o s&oacute;cio).</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Servi&ccedil;o:</strong><br />\r\nFesta da Uva de Jundia&iacute;<br />\r\nData: 4 de fevereiro de 2023<br />\r\nHor&aacute;rio: 8h<br />\r\nRetorno: 17h&nbsp;<br />\r\nValores: R$ 80,00 - s&oacute;cio e R$ 100,00 - n&atilde;o s&oacute;cio<br />\r\n(Forma de pagamento: Pix/d&eacute;bito/cr&eacute;dito em at&eacute; 3X)&nbsp;Informa&ccedil;&otilde;es e vendas: Diretoria de Eventos APVE (12) 3925-5215 <a href=\"https://api.whatsapp.com/send?phone=551239255215\">(WhatsApp)</a><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-19 11:13:36','2023-01-19 11:13:36'),
(2283,394,'1',NULL,2154,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>Clube de leitura retorna com livro de J&ocirc; Soares</strong><br />\r\n<em>Trama de &ldquo;O Xang&ocirc; de Baker Street&rdquo; &eacute; debatida na APVE</em></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Neste m&ecirc;s, o Clube de Leitura da Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE) retorna trazendo a obra &ldquo;O Xang&ocirc; de Baker Street&rdquo;, do apresentador e humorista brasileiro J&ocirc; Soares. O encontro acontecer&aacute; dia 9 de fevereiro, &agrave;s 15h, na biblioteca da institui&ccedil;&atilde;o.</p>\r\n\r\n<p style=\"text-align: justify;\">A trama acontece na cidade do Rio de Janeiro e mistura personagens inusitados, como uma famosa artista francesa, o imperador Dom Pedro II e a dupla de investigadores mais famosa do mundo: Holmes e Watson. Juntos, buscam solucionar o desaparecimento de um valioso violino.</p>\r\n\r\n<p style=\"text-align: justify;\">O evento ser&aacute; mediado por Paulo Elache e todos que tiverem feito a leitura do livro e que se inscreverem pelo WhatsApp Cultural (12) 3925-5209 poder&atilde;o participar do debate. O encontro ser&aacute; dividido em duas ocasi&otilde;es.</p>\r\n\r\n<p style=\"text-align: justify;\">Todos os meses a APVE sugere a leitura de um t&iacute;tulo liter&aacute;rio, convidando as pessoas a mergulharem na hist&oacute;ria e, por meio dela, fomentar discuss&otilde;es enriquecedoras acerca de cen&aacute;rios, personagens e enredo.</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nClube de leitura &ndash; O Xang&ocirc; de Baker Street<br />\r\nData: 9 de fevereiro de 2023<br />\r\nHor&aacute;rio: 15h<br />\r\nLocal: Biblioteca da APVE<br />\r\nMediador: Paulo Elache<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-19 17:15:04','2023-01-19 17:15:04'),
(2291,390,'1',NULL,NULL,'<h3><strong>Caf&eacute; com Prosa</strong></h3>\r\n\r\n<p>Sempre na 2&ordf; ter&ccedil;a-feira do m&ecirc;s.<br />\r\nO tema ser&aacute;: O Materialismo e o Consumismo &ndash; Doen&ccedil;a da Modernidade<br />\r\nModerador: Ricardo Martins de Melo<br />\r\nDia: 14/02/23 &ndash; ter&ccedil;a-feira<br />\r\nHor&aacute;rio: 16h<br />\r\nLocal: lanchonete da APVE</p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es: na biblioteca&nbsp;da APVE<br />\r\n&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://forms.office.com/r/494ZhwT2mK\">Fa&ccedil;a a sua inscri&ccedil;&atilde;o aqui</a></p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-01-23 16:48:01','2023-01-23 16:48:01'),
