(2342,382,'1',NULL,2118,'<p>&nbsp;</p>\r\n\r\n<h1 style=\"text-align: center;\"><strong>Sa&uacute;de integrativa &eacute; tema de primeira a&ccedil;&atilde;o sa&uacute;de da APVE</strong><br />\r\n<em>Evento acontecer&aacute; no dia 9 de fevereiro, a partir das 8h30, e abordar&aacute; a import&acirc;ncia da sa&uacute;de integral no combate a enfermidades</em></h1>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\nMente e corpo. Raz&atilde;o e emo&ccedil;&atilde;o. Olhar com aten&ccedil;&atilde;o para o todo pode ser a melhor sa&iacute;da para quem busca uma vida mais saud&aacute;vel e mais equilibrada. Assim, a Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE), por meio da primeira A&ccedil;&atilde;o Sa&uacute;de de 2023, traz palestras focadas na import&acirc;ncia da sa&uacute;de integral como aliada do bem-estar. O evento acontece dia <strong>9 de fevereiro, das 8h30 &agrave;s 17h,</strong> no Sal&atilde;o A da institui&ccedil;&atilde;o.</p>\r\n\r\n<p style=\"text-align: justify;\">Com o objetivo de mostrar ao p&uacute;blico o que &eacute; e como funciona a sa&uacute;de integral &ndash; que tem o indiv&iacute;duo como objeto de estudo, sem focar na doen&ccedil;a &ndash;, especialistas apresentam assuntos relacionados aos benef&iacute;cios das pr&aacute;ticas integrativas e do uso de plantas medicinais.</p>\r\n\r\n<p style=\"text-align: justify;\">Temas como fitoterapia, sa&uacute;de da mulher e o uso de ch&aacute;s est&atilde;o na programa&ccedil;&atilde;o e prometem apresentar reflex&otilde;es sobre como cada um pode cuidar melhor da sa&uacute;de. Ainda durante o dia, ser&atilde;o oferecidos servi&ccedil;os de aferi&ccedil;&atilde;o de press&atilde;o e de glicemia. O evento &eacute; gratuito e aberto aos s&oacute;cios. Para participar, os interessados devem fazer a inscri&ccedil;&atilde;o abaixo.&nbsp;</p>\r\n\r\n<p>O A&ccedil;&atilde;o Sa&uacute;de conta com a colabora&ccedil;&atilde;o dos parceiros: Droga Raia; Kelly da Energy; Alm&aacute; Fitoterapia; Produtos Naturoprime; Unimed; Hap Vida; Santa Casa; Uniodonto e Cotrel.</p>\r\n\r\n<h3><span style=\"color:#27ae60;\"><strong>Programa&ccedil;&atilde;o:&nbsp;</strong></span></h3>\r\n\r\n<p>► 9h&nbsp;<br />\r\nPalestra:&nbsp;<strong>Tema: Ch&aacute;, Difus&atilde;o ou decoc&ccedil;&atilde;o. Como fazer e qual a diferen&ccedil;a?</strong><br />\r\nPalestrante: L&eacute;o do Colher</p>\r\n\r\n<p>► 9h30 -&nbsp;<strong>Medita&ccedil;&atilde;o Guiada</strong>&nbsp;-&nbsp;Vanessa Massoterapeuta&nbsp;</p>\r\n\r\n<p>► 9h40<br />\r\nPalestra<strong>&nbsp;Tema: Sa&uacute;de da Mulher na era 5G &nbsp;</strong><br />\r\nPalestrante: Arthur Rios (Naturopatia)</p>\r\n\r\n<p>► 10h30&nbsp;<br />\r\nPalestra&nbsp;<strong>Tema: Fitoterapia&nbsp;</strong><br />\r\nPalestrante:&nbsp;</p>\r\n\r\n<p>► 15h<br />\r\nPalestra:&nbsp;<strong>Tema: Terapias alternativas no complemento da sa&uacute;de integral</strong><br />\r\nPalestrante: Enfermeira Larissa - Unimed</p>\r\n\r\n<p>► 16h&nbsp;<br />\r\nPalestra&nbsp;<strong>Tema: Fitoterapia&nbsp;</strong><br />\r\nPalestrante: Rony (Canteiro de Ervas)</p>\r\n\r\n<p>►16h30<br />\r\nPalestra&nbsp;<strong>Tema: Sa&uacute;de da Mulher na era 5G &nbsp;</strong><br />\r\nPalestrante: Arthur Rios (Naturopatia)</p>\r\n\r\n<p>► Das 9h &agrave;s 12h -&nbsp;<strong>Aplica&ccedil;&atilde;o de Reiki:</strong>&nbsp;Reikiana Luiza</p>\r\n\r\n<p>► Das 13h &agrave;s 17h -&nbsp;<strong>Aplica&ccedil;&atilde;o de Reiki:</strong>&nbsp;Reikiana Andrea</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>_</p>\r\n\r\n<p><span style=\"color:#27ae60;\"><strong>Parceiros</strong></span></p>\r\n\r\n<p><strong>Filtros de &aacute;gua Purifc&nbsp;</strong><br />\r\nIr&aacute; fornecer &aacute;gua no evento, que possui filtros com elementos da natureza.</p>\r\n\r\n<p><strong>DROGA RAIA</strong><br />\r\nAferi&ccedil;&atilde;o de press&atilde;o e glicemia<br />\r\nHor&aacute;rio: 8:30h e 17:30h&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 style=\"text-align: center;\"><a class=\"btn btn-primary\" href=\"https://forms.office.com/r/WrAfh8BDHr\">Fa&ccedil;a aqui a sua inscri&ccedil;&atilde;o gratuita nas palestras e atividades</a></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nA&ccedil;&atilde;o Sa&uacute;de<br />\r\nSa&uacute;de Integrativa<br />\r\nData: 9 de fevereiro<br />\r\nHor&aacute;rio: das 8h30 &agrave;s 17h<br />\r\nLocal: sal&atilde;o A da APVE<br />\r\nInforma&ccedil;&otilde;es: (12) 3925-5200<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-02 17:22:06','2023-02-02 17:22:06'),
