(2349,214,'1',NULL,2166,'<h4 paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{14}\" paraid=\"95827986\">&nbsp;</h4>\r\n\r\n<h4 paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{14}\" paraid=\"95827986\"><strong>Sexta Dan&ccedil;ante 2023 (Primeiro Semestre)&nbsp;</strong></h4>\r\n\r\n<p paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{22}\" paraid=\"312067130\">&bull; 17/02 &ndash; Especial Carnaval &ndash; Gil Brasil <em>(liberado o uso de t&ecirc;nis e sapat&ecirc;nis neste dia)&nbsp;</em></p>\r\n\r\n<p paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{40}\" paraid=\"493755483\">&bull; 31/03 &ndash; Banda Homens de Preto&nbsp;&nbsp;</p>\r\n\r\n<p paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{50}\" paraid=\"1838399636\">&bull; 28/04 &ndash; Banda Premium&nbsp;&nbsp;</p>\r\n\r\n<p paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{60}\" paraid=\"373459260\">&bull; 26/05 &ndash; Especial Anos 60 &ndash; Gil Brasil&nbsp;&nbsp;</p>\r\n\r\n<p paraeid=\"{98ba31c3-154b-44ec-af7a-c0f02797028d}{70}\" paraid=\"1465627686\">&bull; 23/06 &ndash; Especial Junino &ndash; Banda Oppus <em>(liberado o uso de t&ecirc;nis e sapat&ecirc;nis neste dia)&nbsp;</em></p>\r\n\r\n<p><br />\r\n► Baile: 20h30 &agrave;s 2h | Bilheteria: 20h30 &agrave;s 00h30</p>\r\n\r\n<p>Em 2023 teremos vantagens para quem adquire seu ingresso antecipadamente:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><strong>Antecipado (Quarta-feira venda para s&oacute;cio e Quinta-feira venda para n&atilde;o s&oacute;cio na secretaria da APVE) &nbsp;</strong></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mesa:&nbsp;S&oacute;cio: R$20,00&nbsp; / N&atilde;o S&oacute;cio: R$30,00&nbsp;</p>\r\n\r\n<p>Bilhetes:&nbsp; S&oacute;cio: 15,00 /&nbsp; N&atilde;o s&oacute;cio: R$40 / Inteira e R$20 meia *</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><strong>No dia do evento&nbsp;</strong></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Bilheteria &nbsp;</em></p>\r\n\r\n<p>Mesa:S&oacute;cio: R$20,00&nbsp; / N&atilde;o S&oacute;cio: R$30,00&nbsp;</p>\r\n\r\n<p>Ingresso S&oacute;cio: 20,00&nbsp; / N&atilde;o s&oacute;cio: R$50 inteira e R$25 meia *</p>\r\n\r\n<p><br />\r\n*Meia entrada ou benef&iacute;cio s&oacute;cio mediante apresenta&ccedil;&atilde;o de<br />\r\ndocumentos.</p>\r\n\r\n<p><br />\r\n&bull; Participe do grupo de Whatsaap: (12) 3925-5215</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a class=\"btn btn-primary\" href=\"https://apve.com.br/uploads/sexta-dancante/1663003631-regras-sexta-dancante-2022.pdf\" target=\"_blank\">CLIQUE AQUI E CONFIRA AS REGRAS</a></strong><br />\r\n&nbsp;</p>',NULL,4,'col-sm-12','left','col-sm-8','col-sm-12',NULL,'card card-body bg-white mt-3','2023-02-06 17:16:51','2023-02-06 17:16:51'),
(2355,403,'1',NULL,NULL,'<h1><strong>APVE disponibiliza novas datas para viagem ao Cost&atilde;o do Santinh</strong>o<br />\r\n<em>Vendas dos pacotes acontecem nesta ter&ccedil;a-feira, 14</em></h1>\r\n\r\n<p>A APVE preparou um roteiro incr&iacute;vel para as suas f&eacute;rias: ser&atilde;o quatro dias, de&nbsp;<strong>20 a 24 de agosto</strong>&nbsp;e de&nbsp;<strong>25 a 29 de setembro 2023</strong>, no famoso resort Cost&atilde;o do Santinho, em Florian&oacute;polis, Santa Catarina.<br />\r\nRodeado por mata nativa e s&iacute;tios arqueol&oacute;gicos, o empreendimento oferece seis restaurantes, sendo a gastronomia uma das atra&ccedil;&otilde;es especiais do local. O regime de alimenta&ccedil;&atilde;o &eacute; o &ldquo;VIP Inclusive&rdquo;, que, al&eacute;m das refei&ccedil;&otilde;es, inclui bebidas alc&oacute;olicas.<br />\r\nCom um spa luxuoso, o Cost&atilde;o do Santinho disp&otilde;e de diversas op&ccedil;&otilde;es de tratamentos, de desintoxica&ccedil;&atilde;o &agrave; talassoterapia. &Eacute; poss&iacute;vel, ainda, desfrutar de uma massagem relaxante e aproveitar a banheira de hidromassagem. O sal&atilde;o de beleza tamb&eacute;m estar&aacute; dispon&iacute;vel.<br />\r\nAs instala&ccedil;&otilde;es esportivas do resort incluem piscinas, paintball, golfe e t&ecirc;nis. As acomoda&ccedil;&otilde;es possuem vista para o jardim, bem como TV a cabo e m&uacute;sica ambiente. Entre as op&ccedil;&otilde;es de passeio, est&aacute; uma visita ao Morro das Aranhas, um santu&aacute;rio de vida selvagem, dispon&iacute;veis para pessoas de todas as idades.</p>\r\n\r\n<h4><strong>Gostou? Saiba como garantir sua reserva!</strong></h4>\r\n\r\n<p>No dia 14 de fevereiro (ter&ccedil;a-feira) ser&aacute; poss&iacute;vel fechar o seu pacote com a APVE. Nessa data, &agrave;s 18h30, na sede da APVE, em S&atilde;o Jos&eacute; dos Campos, acontecer&aacute; um encontro com a respons&aacute;vel pelas vendas da ag&ecirc;ncia de turismo. Na ocasi&atilde;o, ela vai tirar todas as d&uacute;vidas sobre a viagem e fazer as vendas.</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><strong>Investimento da viagem:</strong></h4>\r\n\r\n<p><strong>&bull;&nbsp;&nbsp; &nbsp;20 a 24/08 &ndash; R$3.214,00;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;25 a 29/09 &ndash; R$3.663,00;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Traslado SJC-Aeroporto e Aeroporto-SJC: R$150,00 &ndash; S&oacute;cios&nbsp;<br />\r\nR$180,00 &ndash; N&atilde;o S&oacute;cios.&nbsp;</strong></p>\r\n\r\n<p><strong>Obs.: o passeio pode ser pago em at&eacute; 10 vezes no cart&atilde;o de cr&eacute;dito. A taxa do traslado pode ser feita em at&eacute; 3 vezes no cart&atilde;o de cr&eacute;dito.</strong></p>\r\n\r\n<h4><br />\r\n<strong>Incluso no pagamento (diretamente com o Cost&atilde;o do Santinho):</strong></h4>\r\n\r\n<p><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hospedagem (com todas refei&ccedil;&otilde;es e bebidas inclusas*);<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Acomoda&ccedil;&atilde;o: Vilas Portuguesas &ndash; apartamento duplo, triplo, quadruplo ou qu&iacute;ntuplo;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;A&eacute;reo (Florian&oacute;polis/SC) e uma bagagem de 23 kg despachada (a&eacute;reo com sa&iacute;da de Guarulhos ou Congonhas);<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Transfer: &ldquo;aeroporto x resort&rdquo; e &ldquo;resort x aeroporto&rdquo;;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Taxas.<br />\r\n*Vip inclusive: refei&ccedil;&otilde;es, lanches, frigobar (&aacute;gua e refrigerante), sucos, drinks, caipirinhas com vodka sagatiba e vodka sky, chopp e cerveja, vinhos selecionados, whisky 8 anos e espumante nacional.&nbsp;<br />\r\n&nbsp;<br />\r\nObs.: valores diferenciados para crian&ccedil;as (at&eacute; 11 anos). Outros tipos de acomoda&ccedil;&atilde;o podem ser consultados.&nbsp;</p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es podem ser consultadas pelo e-mail apve@apve.com.br ou pelo WhatsApp (12) 3925-5215. A sede da APVE fica localizada na Alameda C&acirc;ndido Marciano Leite, n&ordm; 88, no bairro Vila Beth&acirc;nia, em S&atilde;o Jos&eacute; dos Campos/SP.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Servi&ccedil;o:</strong><br />\r\nViagem Resort Cost&atilde;o do Santinho<br />\r\nPer&iacute;odo: de 20 a 24 de agosto e de 25 a 29 de setembro<br />\r\nVendas: a partir de 14/02/2023<br />\r\nInforma&ccedil;&otilde;es: e-mail apve@apve.com.br ou pelo WhatsApp (12) 3925-5215.&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-13 09:51:55','2023-02-13 09:51:55'),
