c;nia, em S&atilde;o Jos&eacute; dos Campos/SP.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Servi&ccedil;o:</strong><br />\r\nViagem Resort Cost&atilde;o do Santinho<br />\r\nPer&iacute;odo: de 20 a 24 de agosto e de 25 a 29 de setembro<br />\r\nVendas: a partir de 14/02/2023<br />\r\nInforma&ccedil;&otilde;es: e-mail apve@apve.com.br ou pelo WhatsApp (12) 3925-5215.&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-13 10:41:04','2023-02-13 10:41:04'),
(2364,401,'1',NULL,2188,'<p>&nbsp;</p>\r\n\r\n<h1>&nbsp;</h1>\r\n\r\n<h1><em><strong>A APVE continua em seu processo de melhoria cont&iacute;nua</strong></em></h1>\r\n\r\n<p style=\"text-align: justify;\">Com intuito de levar mais comodidade para o associado, a APVE implementou em dezembro de 2022 um novo sistema gest&atilde;o: agora, <strong>al&eacute;m do envio tradicional pelos Correios</strong>, os boletos <strong>s&atilde;o enviados diretamente para o e-mail do associado.</strong></p>\r\n\r\n<p style=\"text-align: justify;\">Em virtude do que vem sendo divulgado nas m&iacute;dias todos os dias, alertando sobre fraudes e golpes que s&atilde;o aplicados por meios digitais, e diante da preocupa&ccedil;&atilde;o da APVE com o associado, pedimos que sempre verifique as informa&ccedil;&otilde;es que s&atilde;o apontadas quando do preenchimento dos dados para pagamento junto &agrave; institui&ccedil;&atilde;o financeira, confrontando os dados do favorecido com os do benefici&aacute;rio, tais como Raz&atilde;o Social e CNPJ.</p>\r\n\r\n<p style=\"text-align: justify;\">Separamos algumas dicas para auxiliar a n&atilde;o cair em golpes como esse. Confira:</p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">Observe o banco que vai receber o pagamento: <strong>a APVE utiliza o Santander.</strong></li>\r\n	<li style=\"text-align: justify;\">Verifique se o destinat&aacute;rio, na hora do pagamento, aparece como: <strong>Associa&ccedil;&atilde;o Dos Pioneiros E Veteranos da Embraer</strong> e com o <strong>CNPJ 53.324.216/0001-79.</strong></li>\r\n</ul>\r\n\r\n<p style=\"text-align: justify;\">Lembramos que, para a sua seguran&ccedil;a, &eacute; importante realizar todas estas verifica&ccedil;&otilde;es antes da confirma&ccedil;&atilde;o do pagamento de boletos.</p>\r\n\r\n<p style=\"text-align: justify;\">Em caso de d&uacute;vidas, entre em contato com nossos atendentes pelo telefone ou WhatsApp (12) 3925-5200 ou pelo e-mail apve@apve.com.br.</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-13 16:59:53','2023-02-13 16:59:53'),
(2367,407,'1',NULL,2195,'<p>&nbsp;</p>\r\n\r\n<h1 style=\"text-align: center;\"><strong>Primeira Sexta Dan&ccedil;ante da APVE acontece esta semana</strong><br />\r\n<em>Baile &eacute; o primeiro de 2023 e acontecer&aacute; nesta sexta, 17</em></h1>\r\n\r\n<p>A Associa&ccedil;&atilde;o dos Pioneiros e Veteranos da Embraer (APVE) realizar&aacute; na pr&oacute;xima sexta-feira (17), &agrave;s 21h, o primeiro baile de 2023. Na ocasi&atilde;o, os convidados poder&atilde;o curtir uma festa com m&uacute;sicas de Carnaval, ao som de Gil Brasil. As fantasias e os cal&ccedil;ados esportivos podem fazer parte desta festa.</p>\r\n\r\n<p>Para participar da Sexta Dan&ccedil;ante, que &eacute; aberta ao p&uacute;blico, a secretaria da institui&ccedil;&atilde;o ser&aacute; a respons&aacute;vel pela venda dos ingressos. Os valores v&atilde;o de R$ 15 a R$ 40 nas compras antecipadas (quarta-feira para s&oacute;cios e quinta-feira para visitantes) e de R$ 20 a R$ 50 no dia do evento.</p>\r\n\r\n<p>Em 2023, os bailes ser&atilde;o mensais e a programa&ccedil;&atilde;o para este semestre j&aacute; pode ser conferida. Veja a seguir:</p>\r\n\r\n<p>&bull; &nbsp; 17/02 &ndash; Especial Carnaval &ndash; Gil Brasil (liberado o uso de t&ecirc;nis e sapat&ecirc;nis neste dia)&nbsp;<br />\r\n&bull; &nbsp; 31/03 &ndash; Banda Homens de Preto &nbsp;<br />\r\n&bull; &nbsp; 28/04 &ndash; Banda Premium &nbsp;<br />\r\n&bull; &nbsp; 26/05 &ndash; Especial Anos 60 &ndash; Gil Brasil &nbsp;<br />\r\n&bull; &nbsp;23/06 &ndash; Especial Junino &ndash; Banda Oppus (liberado o uso de t&ecirc;nis e sapat&ecirc;nis neste dia)</p>\r\n\r\n<p><strong>Valores &ndash; vendas antecipadas</strong><br />\r\n&bull; Mesas: R$ 20 (s&oacute;cios); R$ 30 (n&atilde;o s&oacute;cios)<br />\r\n&bull; Bilhete: R$ 15 (s&oacute;cios); R$ 40 inteira e meia R$ 20 (n&atilde;o s&oacute;cios)</p>\r\n\r\n<p><strong>Valores &ndash; vendas no dia</strong><br />\r\n&bull; Mesas: R$ 20 (s&oacute;cios); R$ 30 (n&atilde;o s&oacute;cios)<br />\r\n&bull; Bilhete: R$ 20 (s&oacute;cios); R$ 50 inteira e meia R$ 25 (n&atilde;o s&oacute;cios)</p>\r\n\r\n<p><strong>Hor&aacute;rios do baile</strong><br />\r\n&bull; Bilheteria: das 20h30 &agrave;s 00h30 (enquanto durar os convites/mesas)<br />\r\n&bull; Baile: das 21h &agrave;s 2h</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>VENDAS ANTECIPADAS ASSOCIADOS APVE:&nbsp;&nbsp;</strong>Quarta-feira &ndash; das 9h &agrave;s 12h e das 14h &agrave;s 16h30<br />\r\nVenda de ingressos e reservas de mesas presencialmente ou por telefone<br />\r\nLimite de venda &ndash; Geral:180 ingressos e 45 mesas</p>\r\n\r\n<p>Todo o associado que reservar mesa pelo telefone dever&aacute; se apresentar na bilheteria do evento com a sua carteirinha at&eacute; &agrave;s 21h30 e assinar confirmando sua presen&ccedil;a. Caso o associado n&atilde;o se apresente por dois (2) bailes consecutivos, perder&aacute; o direito de reserva no pr&oacute;ximo baile. Caso o associado tenha feito a reserva e n&atilde;o possa comparecer ao evento, &eacute; necess&aacute;rio comunicar a coordena&ccedil;&atilde;o de eventos at&eacute; o dia do evento, &agrave;s 12h, para cancelar a reserva.</p>\r\n\r\n<p><strong>N&Atilde;O ASSOCIADOS:&nbsp;</strong>Quinta feira &ndash; das 9h &agrave;s 12h e das 14h &agrave;s 16h30<br />\r\n&bull; Somente venda de ingressos e de mesas<br />\r\n&bull; Limite de venda-Geral: 170 ingressos e 45 mesas</p>\r\n\r\n<p><strong>Estacionamento:</strong><br />\r\n&bull; Associados: liberado mediante apresenta&ccedil;&atilde;o de carteirinha.<br />\r\n&bull; N&atilde;o associados: Carro: Valor R$10,00 / Moto: R$5,00<br />\r\n&bull; Pagamento na bilheteria na entrada do evento</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-14 13:29:48','2023-02-14 13:29:48'),
(2371,210,'1',NULL,2201,'<h3 style=\"text-align: center;\">Tri&ecirc;nio 2021-2023</h3>',NULL,3,'col-sm-12','right','col-sm-12','col-sm-12',NULL,NULL,'2023-02-23 14:04:56','2023-02-23 14:04:56'),
