(2375,210,'1',NULL,NULL,'<h3>&nbsp;</h3>\r\n\r\n<p>CONFIRA O ESTATUTO VIGENTE</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://apve.com.br/uploads/uploads//1660054438-estatuto-vigente.pdf\" target=\"_blank\">ESTATUTO</a></p>',NULL,7,'col-sm-12','none',NULL,'col-sm-12',NULL,NULL,'2023-02-23 14:04:56','2023-02-23 14:04:56'),
(2376,410,'1',NULL,NULL,'<p>Evento acontecer&aacute; de <strong>20 a 24 de mar&ccedil;o, a partir das 17h</strong></p>\r\n\r\n<p><br />\r\nA Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE) realizar&aacute;, de 20 a 24 de mar&ccedil;o, no sal&atilde;o de jogos, um torneio de bilhar. Podem participar da competi&ccedil;&atilde;o s&oacute;cios e visitantes j&aacute; cadastrados no sistema da institui&ccedil;&atilde;o.<br />\r\nCom o objetivo de levar entretenimento aos frequentadores, possibilitando uma competi&ccedil;&atilde;o amistosa e divertida, os participantes ter&atilde;o a oportunidade de testar jogadas e de, quem sabe, levar para casa o trof&eacute;u de primeiro lugar.<br />\r\nPara participar, os interessados devem procurar a secretaria da APVE, no per&iacute;odo de <strong>9 a 16 de mar&ccedil;o</strong>, e realizar o pagamento da taxa de R$ 10. No dia 17 de mar&ccedil;o, &agrave;s 17h, os organizadores do evento far&atilde;o o sorteio das chaves, assim como definir&atilde;o a ordem de jogada.<br />\r\nAp&oacute;s a partida final, todos os competidores est&atilde;o convidados a participar de um coquetel de confraterniza&ccedil;&atilde;o.</p>\r\n\r\n<p>Servi&ccedil;o:<br />\r\nTorneio de Bilhar<br />\r\nData: de 20 a 24 de mar&ccedil;o<br />\r\nInscri&ccedil;&otilde;es: de 9 a 16 de mar&ccedil;o<br />\r\nValor: R$ 10<br />\r\nDefini&ccedil;&atilde;o das chaves: 17 de mar&ccedil;o, 17h<br />\r\nLocal: Sal&atilde;o de jogos da APVE</p>\r\n\r\n<p>EM DUPLAS<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 09:33:07','2023-02-27 09:33:07'),
(2379,411,'1',NULL,2203,'<h2><strong>APVE fecha novo contrato com o conv&ecirc;nio m&eacute;dico da Unimed. Inclus&otilde;es realizadas entre 01/03 &agrave; 31/03, nos planos APVE Flex 25 e Participativo, ter&atilde;o car&ecirc;ncia reduzida.</strong></h2>\r\n\r\n<p><br />\r\nE os associados que fizerem a contrata&ccedil;&atilde;o entre 01/03 a 31/03, ter&atilde;o car&ecirc;ncia reduzida, exceto para Doen&ccedil;as ou Les&otilde;es Preexistentes (DLP) e parto.<br />\r\nNa op&ccedil;&atilde;o APVE Flex 25, o diferencial &eacute; a ado&ccedil;&atilde;o do sistema coparticipativo apenas em consultas (consult&oacute;rios e pronto atendimento), nas quais o associado paga o valor m&iacute;nimo de R$ 25,00. J&aacute; no plano Participativo, &eacute; cobrada uma coparticipa&ccedil;&atilde;o em cima exames, interna&ccedil;&otilde;es, procedimentos, exames (b&aacute;sicos e especiais) e interna&ccedil;&atilde;o, mas o valor da mensalidade &eacute; reduzido. A ades&atilde;o pode ser feita por funcion&aacute;rios e ex-funcion&aacute;rios da Embraer que sejam associados &agrave; APVE e seus dependentes.</p>\r\n\r\n<p><strong>Os interessados podem entrar em contato com a secretaria de conv&ecirc;nios da APVE pelos telefones (12) 3925-5205 (WhatsApp) / 3925-5213 ou por e-mail convenios@apve.com.br.</strong></p>\r\n\r\n<p>N&atilde;o perca essa oportunidade. Cuide de voc&ecirc; e de sua fam&iacute;lia!<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 09:48:06','2023-02-27 09:48:06'),
(2380,412,'1',NULL,NULL,'<h2><strong>Curso de cerveja &nbsp; - Introdu&ccedil;&atilde;o ao mundo da cerveja</strong></h2>\r\n\r\n<p><em>Evento &eacute; aberto ao p&uacute;blico e &eacute; ministrado pelo especialista Alexandre Bleed</em></p>\r\n\r\n<p>O evento, trazido pela Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE), ser&aacute; ministrado pelo sommelier Alexandre Bleed e acontecer&aacute; no audit&oacute;rio da institui&ccedil;&atilde;o, nos dias 28 e 30 de mar&ccedil;o; 4, 6, 11 e 13 de abril, das 18h30 &agrave;s 22h30. Total de 6 encontros.&nbsp;</p>\r\n\r\n<p>Quer saber sobre as caracter&iacute;sticas de cada cerveja, conhecer a hist&oacute;ria dela e ainda aprender sobre harmoniza&ccedil;&atilde;o?</p>\r\n\r\n<p>Ent&atilde;o, fa&ccedil;a a sua inscri&ccedil;&atilde;o pelo n&uacute;mero <strong>(12) 3925-5215</strong>, Para s&oacute;cios, o valor &eacute; de R$ 650 e para os n&atilde;o s&oacute;cios, R$ 750 (valores podem ser parcelados em at&eacute; 5x no cart&atilde;o)&nbsp;<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 09:58:38','2023-02-27 09:58:38'),
(2381,414,'1',NULL,NULL,'<h2><strong>Cost&atilde;o do Santinho &ndash; Nova data de vendas</strong></h2>\r\n\r\n<p><strong>Pr&oacute;xima reuni&atilde;o de vendas e apresenta&ccedil;&atilde;o do resort dia 21/03 em dois per&iacute;odos: 13h e 18h no sal&atilde;o A.&nbsp;</strong></p>\r\n\r\n<p><br />\r\nA APVE preparou um roteiro incr&iacute;vel para as suas f&eacute;rias: ser&atilde;o quatro dias, de 20 a 24 de agosto e de 25 a 29 de setembro 2023, no famoso resort Cost&atilde;o do Santinho, em Florian&oacute;polis, Santa Catarina.&nbsp;<br />\r\nInvestimento da viagem:</p>\r\n\r\n<p><br />\r\n20 a 24/08 &ndash; R$3.214,00;</p>\r\n\r\n<p>25 a 29/09 &ndash; R$3.663,00;</p>\r\n\r\n<p><br />\r\nTraslado SJC-Aeroporto e Aeroporto-SJC: R$150,00 &ndash; S&oacute;cios &nbsp;R$180,00 &ndash; N&atilde;o S&oacute;cios.&nbsp;</p>\r\n\r\n<p>Obs.: o passeio pode ser pago em at&eacute; 10 vezes no cart&atilde;o de cr&eacute;dito. A taxa do traslado pode ser feita em at&eacute; 3 vezes no cart&atilde;o de cr&eacute;dito.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es, <a href=\"https://apve.com.br/noticias/viaje-com-a-apve-costao-do-santinho-em-florianopolis\">clique aqui.&nbsp;</a><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 10:03:05','2023-02-27 10:03:05'),
(2382,417,'1',NULL,NULL,'<h2><strong>Sexta Dan&ccedil;ante de mar&ccedil;o acontece dia 31/03 com a Banda Homens de Preto</strong></h2>\r\n\r\n<p>E 2023 promete, afinal, o show tem que continuar!&nbsp;</p>\r\n\r\n<p>*Aten&ccedil;&atilde;o aos novos valores para este ano:</p>\r\n\r\n<ul>\r\n	<li>Mesas (4 lugares) &bull; S&oacute;cio &ndash; R$20,00 &bull; N&atilde;o S&oacute;cio &ndash; R$30,00</li>\r\n	<li>Bilhete S&oacute;cio APVE (venda antecipada): R$15,00 Bilhete | N&atilde;o s&oacute;cio: Inteira R$40,00 e Meia R$20,00 (mediante documento comprobat&oacute;rio)</li>\r\n	<li>Bilhete S&oacute;cio APVE (no dia do evento): R$20,00 Bilhete | N&atilde;o s&oacute;cio: Inteira R$50,00 e Meia R$25,00 (mediante documento comprobat&oacute;rio)</li>\r\n	<li>As vendas ocorrem as quartas-feiras para associados e as quintas-feiras para n&atilde;o associados.</li>\r\n</ul>\r\n\r\n<p><em>Venda antecipada somente na semana no evento.</em></p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es com a Diretoria de Eventos Sociais pelo telefone ou WhatsApp (12) 3925-5215.</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 10:08:19','2023-02-27 10:08:19'),
(2384,418,'1',NULL,NULL,'<h2><strong>Clube de Leitura</strong></h2>\r\n\r\n<p><strong>Data: 23/03 &ndash; quinta-feira &agrave;s 15h</strong><br />\r\nLocal: Biblioteca da APVE<br />\r\nLivro: Sagarana &ndash; Jo&atilde;o Guimar&atilde;es Rosa<br />\r\nMediadora: Julia Bischoff</p>\r\n\r\n<p><br />\r\nO que fala a obra Sagarana?<br />\r\nResultado de imagem para livro Sagarana. Sagarana &eacute; o primeiro livro de Jo&atilde;o Guimar&atilde;es Rosa.<br />\r\nPublicado em 1946, &eacute; uma obra regionalista, com car&aacute;ter universal, j&aacute; que trata de temas como a viol&ecirc;ncia, al&eacute;m do conflito entre o bem e o mal. O t&iacute;tulo do livro &eacute; um neologismo que une saga (de origem alem&atilde;, sagen) e rana (de origem tupi).</p>\r\n\r\n<p>Inscri&ccedil;&otilde;es no WhatsApp da Biblioteca (12) 3925-5209&nbsp;<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 10:27:28','2023-02-27 10:27:28'),
(2385,419,'1',NULL,NULL,'<h2><strong>Psican&aacute;lise e Cinema</strong></h2>\r\n\r\n<p>Dia 23/03 &nbsp;Hor&aacute;rio: 19h<br />\r\nLocal: Cine Cultura M&aacute;rio Leme Galv&atilde;o &ndash; ao lado da biblioteca da APVE</p>\r\n\r\n<p>Filme &ndash; &ldquo;El m&eacute;todo&rdquo; (2005), filme argentino-hispano-italiano, dirigido por Marcelo Pi&ntilde;eyro, prop&otilde;e uma discuss&atilde;o acerca das rela&ccedil;&otilde;es e da &eacute;tica, especialmente na situa&ccedil;&atilde;o de trabalho.<br />\r\nMedia&ccedil;&atilde;o: Cassiano de Oliveira &ndash; &eacute; psic&oacute;logo cl&iacute;nico e psicanalista, atua em pr&aacute;tica privada, no atendimento a adolescentes e adultos, na supervis&atilde;o de outros analistas e na coordena&ccedil;&atilde;o de cursos na &aacute;rea.&nbsp;</p>\r\n\r\n<p>Inscri&ccedil;&otilde;es no link: https://forms.office.com/r/HxNM4Rdp0C<br />\r\nIngresso: 1 kg de alimento n&atilde;o perec&iacute;vel entregue no dia do filme (volunt&aacute;rio)<br />\r\n&nbsp;</p>\r\n\r\n<p><a class=\"btn btn-primary\" href=\"https://forms.office.com/r/HxNM4Rdp0C\">Inscri&ccedil;&otilde;es aqui</a></p>\r\n\r\n<p><br />\r\n<em>Ingresso: 1 kg de alimento n&atilde;o perec&iacute;vel entregue no dia do filme (volunt&aacute;rio)</em><br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 11:03:49','2023-02-27 11:03:49'),
(2386,420,'1',NULL,NULL,'<h2><strong>Curso de Franc&ecirc;s</strong></h2>\r\n\r\n<p><br />\r\nO Curso ser&aacute; uma parceria da APVE com o professor J&uacute;lio C&eacute;sar Miri Megda que ministra o &ldquo;COURS DE FRAN&Ccedil;AIS LE LEC&rdquo;.&nbsp;<br />\r\nO Prof. J&uacute;lio residiu um ano na Su&iacute;&ccedil;a e tem 12 anos de experi&ecirc;ncia no ensino da l&iacute;ngua francesa.<br />\r\nAs aulas ser&atilde;o presenciais e semanais, 1x por semana com dura&ccedil;&atilde;o de 1h.&nbsp;</p>\r\n\r\n<p><br />\r\nMaterial: o aluno precisar&aacute; fazer a aquisi&ccedil;&atilde;o de um livro, que ser&aacute; indicado pelo professor no primeiro dia de aula.<br />\r\nP&uacute;blico alvo: associados e n&atilde;o associados adultos.<br />\r\nHor&aacute;rio: Quintas-feiras das 16h &agrave;s 17h<br />\r\nMatr&iacute;cula: R$ 50,00</p>\r\n\r\n<p><br />\r\nAssociados da APVE: R$ 125,00 mensal<br />\r\nN&atilde;o Associados da APVE: R$ 150,00 mensal.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 11:09:50','2023-02-27 11:09:50'),
(2387,421,'1',NULL,NULL,'<p><strong>A&ccedil;&atilde;o Sa&uacute;de: Sa&uacute;de da Mulher</strong><br />\r\n23/03 &ndash; 18h30 &nbsp;A&ccedil;&atilde;o Sa&uacute;de na APVE ser&aacute; no per&iacute;odo noturno&nbsp;</p>\r\n\r\n<p>E contar&aacute; com a palestra sobre &ldquo;Incontin&ecirc;ncia urin&aacute;ria feminina&rdquo;<br />\r\nSal&atilde;o A, evento gratuito e aberto ao p&uacute;blico.&nbsp;<br />\r\nIngresso solid&aacute;rio: um pacote de absorvente&nbsp;</p>\r\n\r\n<p><strong>Palestrante:</strong> Dra. H&eacute;rica Mont&rsquo;Alv&atilde;o &eacute; formada h&aacute; 25 anos pela Faculdade de Medicina de Itajub&aacute;-MG, ginecologista obstetra, j&aacute; realizou mais de 2 mil partos. J&aacute; atuou em postos de sa&uacute;de do SUS e atualmente atende em consult&oacute;rio particular.<br />\r\nCasada h&aacute; 20 anos, &eacute; m&atilde;e de tr&ecirc;s filhos. Criou o podcast Mulheres de Peito, onde recebe convidados para um bate-papo interessante voltado &agrave;s mulheres. Ao todo j&aacute; s&atilde;o mais de 45 epis&oacute;dios que debatem sobre sa&uacute;de, rotina familiar, psicologia e empreendedorismo feminino. Colunista sobre longevidade no Portal Aqui Vale, Dra. H&eacute;rica Mont&rsquo;Alv&atilde;o escreve com foco em pessoas maduras sobre um universo de possibilidades nas melhores idades.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>inscri&ccedil;&otilde;es: WhatsApp Farm&aacute;cia (12) 3925-5201<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 11:14:44','2023-02-27 11:14:44'),
(2388,422,'1',NULL,NULL,'<h2><strong>Doa&ccedil;&atilde;o de Livros &ndash; Campanha Doe Hist&oacute;ria&rdquo;</strong></h2>\r\n\r\n<p>APVE encabe&ccedil;a campanha de arrecada&ccedil;&atilde;o de obras infantis e juvenis. Os livros ser&atilde;o doados para a Escola Euclides Miragaia; campanha segue at&eacute; final de mar&ccedil;o.<br />\r\nEnt&atilde;o, se voc&ecirc; tem algum livro infantil ou infanto-juvenil que j&aacute; n&atilde;o faz sentido ter na estante, que tal trazer para n&oacute;s? Vamos adorar receber sua doa&ccedil;&atilde;o.</p>\r\n\r\n<p><br />\r\nPara participar da campanha &ldquo;Doe Hist&oacute;ria&rdquo;, basta depositar os livros nos locais sinalizados nas entradas da APVE, das 6h &agrave;s 21h, de segunda a sexta, ou s&aacute;bado, das 8h &agrave;s 12h.&nbsp;<br />\r\nA sua participa&ccedil;&atilde;o levar&aacute; ainda mais cores e sonhos aos estudantes da Euclides Miragaia.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 11:17:34','2023-02-27 11:17:34'),
(2389,398,'1',NULL,NULL,'<h2><strong>Oficina Tem&aacute;tica de P&aacute;scoa</strong></h2>\r\n\r\n<p data-pm-slice=\"1 1 []\">A p&aacute;scoa est&aacute; chegando! E a professora Izildinha vai comandar a partir do dia primeiro de mar&ccedil;o uma oficina de artesanato exclusiva para essa data t&atilde;o especial.</p>\r\n\r\n<p>Pensando sempre no modo sustent&aacute;vel, a oficina utiliza materiais recicl&aacute;veis, que se tornam em lindas pe&ccedil;as.</p>\r\n\r\n<p>As aulas acontecem durante os dias <strong>08, 15, 22 e 29 de mar&ccedil;o, das 8h30 at&eacute; &agrave;s 11h30.</strong> O valor &eacute; de R$ 100,00 para associados e R$ 140,00 para n&atilde;o associados. Fa&ccedil;a sua pr&eacute;-inscri&ccedil;&atilde;o pelo WhatsApp (12) 3925-5209</p>\r\n\r\n<p>Participe e deixe sua P&aacute;scoa mais encantadora com esses lindos enfeites!</p>\r\n\r\n<p><br />\r\nFa&ccedil;a sua pr&eacute;-inscri&ccedil;&atilde;o pelo whatsapp 12- 3925-5209</p>\r\n\r\n<p><br />\r\nValor: R$ 100,00 associado &nbsp; R$ 140,00 n&atilde;o associado.<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 11:20:31','2023-02-27 11:20:31'),
(2396,405,'1',NULL,2108,'<h1><strong>Laborat&oacute;rio Unimed realizar&aacute; exames na APVE</strong><br />\r\n<em>A&ccedil;&atilde;o acontece toda &uacute;ltima quinta-feira do m&ecirc;s</em></h1>\r\n\r\n<p>Em parceria com a Unimed, realizar&aacute; exames laboratoriais no pr&oacute;ximo dia 30 de mar&ccedil;o, das 7h30 &agrave;s 9h30 na APVE. A iniciativa ser&aacute; repetida em toda &uacute;ltima quinta-feira dos meses seguintes.</p>\r\n\r\n<p>Para participar, o associado (que j&aacute; seja assistido pela Unimed) deve agendar o servi&ccedil;o pelo e-mail: lab.agendamento@unimedsjc.coop.br&nbsp; ou pelo WhatsApp 12 9 9705 5736 e, no dia marcado, levar o pedido m&eacute;dico. Os atendimentos ser&atilde;o na sala de exames da APVE, localizado na rampa de acesso &agrave; academia.</p>\r\n\r\n<p>Em caso de dificuldade no agendamento &eacute; s&oacute; comparecer no dia e durante o hor&aacute;rio estabelecido.&nbsp;</p>\r\n\r\n<p>Esta &eacute; mais uma a&ccedil;&atilde;o que visa o bem-estar dos associados, proporcionando conforto e levando facilidades para a rotina daqueles que frequentam a Institui&ccedil;&atilde;o.<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n<strong>Servi&ccedil;o:</strong></p>\r\n\r\n<p>A&ccedil;&atilde;o: exames laboratoriais<br />\r\nDia e hora: 30 de mar&ccedil;o, das 7h30 &agrave;s 9h30<br />\r\nP&uacute;blico-alvo: associados<br />\r\nOnde: sala de exames da APVE (pr&oacute;ximo a rampa da academia)</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 11:59:12','2023-02-27 11:59:12'),
(2400,424,'1',NULL,2220,'<h1 style=\"text-align: center;\"><strong>Introdu&ccedil;&atilde;o ao mundo da cerveja: curso acontece na APVE</strong><br />\r\n<em>Evento &eacute; aberto ao p&uacute;blico e &eacute; ministrado pelo especialista Alexandre Bleed</em></h1>\r\n\r\n<p style=\"text-align: justify;\">Conhecer um pouco mais das caracter&iacute;sticas da cerveja, apresentando conceitos e descobrindo hist&oacute;rias relacionadas a ela. Este &eacute; o objetivo do curso &ldquo;Introdu&ccedil;&atilde;o ao mundo da cerveja&rdquo;, ministrado pelo sommelier Alexandre Bleed. O evento, trazido pela Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE), acontecer&aacute; no audit&oacute;rio da institui&ccedil;&atilde;o a partir de 28 de mar&ccedil;o, das 18h30 &agrave;s 22h30.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">O curso ter&aacute; carga hor&aacute;ria de 24 horas, sendo dividido em 6 encontros: 28 e 30 de mar&ccedil;o; 4, 6, 11 e 13 de abril. A cada encontro, o professor trar&aacute; 5 r&oacute;tulos das melhores cervejas do mercado (como Fuller&rsquo;s, Paulaner, Guinness, Pilsner Urquell, Duvel, Hocus Pocus etc) para que os alunos fa&ccedil;am a degusta&ccedil;&atilde;o e passem a entender, na pr&aacute;tica, o conceito te&oacute;rico apresentado.</p>\r\n\r\n<p style=\"text-align: justify;\">Os inscritos receber&atilde;o apostila e caderno de degusta&ccedil;&atilde;o, al&eacute;m de uma certifica&ccedil;&atilde;o ao final do curso &ndash; presen&ccedil;a m&iacute;nima de 75% das aulas. E no &uacute;ltimo dia do curso, Alexandre far&aacute; uma harmoniza&ccedil;&atilde;o guiada, orientando o grupo acerca das melhores combina&ccedil;&otilde;es entre pratos e tipos de cerveja.</p>\r\n\r\n<p style=\"text-align: justify;\">Para se inscrever, os interessados devem utilizar o n&uacute;mero (12)3925-5215, mandando mensagem de whatssapp ou fazendo uma liga&ccedil;&atilde;o convencional. Para s&oacute;cios, o valor &eacute; de R$ 650 e para os n&atilde;o s&oacute;cios, R$ 750. Apenas ser&atilde;o aceitas inscri&ccedil;&otilde;es de pessoas maiores de 18 anos.<br />\r\nAlexandre Bleed &eacute; sommelier de Cervejas, Master in Beer Styles and Evaluation, Juiz Certificado pelo Beer Judge Certification Program e docente da &aacute;rea de sommelieria cervejeira desde 2017. Al&eacute;m de ter feitos cursos de harmoniza&ccedil;&atilde;o gastron&ocirc;mica e de tecnologia avan&ccedil;ada cervejeira. Al&eacute;m de tudo isso, ainda mant&eacute;m a p&aacute;gina Doutor Breja (https://www.doutorbreja.com/), que apresenta diversos conte&uacute;dos sobre o tema.</p>\r\n\r\n<h4 style=\"text-align: justify;\"><strong>Confira o conte&uacute;do do curso:</strong></h4>\r\n\r\n<p style=\"text-align: justify;\"><br />\r\n&bull;&nbsp;&nbsp; &nbsp;O que &eacute; cerveja;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Cerveja de massa x cerveja artesanal;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Divis&otilde;es do universo cervejeiro;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Como avaliar cervejas (introdu&ccedil;&atilde;o a avalia&ccedil;&atilde;o sensorial);&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Ingredientes Cervejeiros;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Como &eacute; feita uma cerveja;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Tipos de fermenta&ccedil;&atilde;o (Ale x Lager x Fermenta&ccedil;&atilde;o espont&acirc;nea);&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Panorama das Escolas Cervejeiras (Alemanha, Inglaterra, B&eacute;lgica e EUA);&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Servi&ccedil;o cervejeiro (ta&ccedil;as e temperatura de servi&ccedil;o);&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Armazenamento cervejeiro;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Leitura e interpreta&ccedil;&atilde;o de r&oacute;tulos;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Cerveja artesanal no Brasil, uma vis&atilde;o do mercado;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Harmoniza&ccedil;&atilde;o gastron&ocirc;mica com cervejas artesanais;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Mitos cervejeiros.</p>\r\n\r\n<p style=\"text-align: justify;\"><strong>Servi&ccedil;o:</strong><br />\r\nCurso de cerveja<br />\r\nData: 28 e 30 de mar&ccedil;o; 4, 6, 11 e 13 de abril<br />\r\nHor&aacute;rio: 18h30 &agrave;s 22h30<br />\r\nInscri&ccedil;&otilde;es: (12)3925-5215<br />\r\nValor: s&oacute;cios - R$ 650; n&atilde;o s&oacute;cios - R$ 750<br />\r\nCarga hor&aacute;ria: 24h<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 15:37:06','2023-02-27 15:37:06'),
(2402,402,'1',NULL,2176,'<p>&nbsp;</p>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE disponibiliza novas datas para viagem ao Cost&atilde;o do Santinh</strong>o<br />\r\n<em>Nova data de vendas dos pacotes acontece&nbsp;dia 21/03, em dois per&iacute;odos 13h e 18h no Sal&atilde;o A</em></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A APVE preparou um roteiro incr&iacute;vel para as suas f&eacute;rias: ser&atilde;o quatro dias, de <strong>20 a 24 de agosto</strong> e de <strong>25 a 29 de setembro 2023</strong>, no famoso resort Cost&atilde;o do Santinho, em Florian&oacute;polis, Santa Catarina.<br />\r\nRodeado por mata nativa e s&iacute;tios arqueol&oacute;gicos, o empreendimento oferece seis restaurantes, sendo a gastronomia uma das atra&ccedil;&otilde;es especiais do local. O regime de alimenta&ccedil;&atilde;o &eacute; o &ldquo;VIP Inclusive&rdquo;, que, al&eacute;m das refei&ccedil;&otilde;es, inclui bebidas alc&oacute;olicas.<br />\r\nCom um spa luxuoso, o Cost&atilde;o do Santinho disp&otilde;e de diversas op&ccedil;&otilde;es de tratamentos, de desintoxica&ccedil;&atilde;o &agrave; talassoterapia. &Eacute; poss&iacute;vel, ainda, desfrutar de uma massagem relaxante e aproveitar a banheira de hidromassagem. O sal&atilde;o de beleza tamb&eacute;m estar&aacute; dispon&iacute;vel.<br />\r\nAs instala&ccedil;&otilde;es esportivas do resort incluem piscinas, paintball, golfe e t&ecirc;nis. As acomoda&ccedil;&otilde;es possuem vista para o jardim, bem como TV a cabo e m&uacute;sica ambiente. Entre as op&ccedil;&otilde;es de passeio, est&aacute; uma visita ao Morro das Aranhas, um santu&aacute;rio de vida selvagem, dispon&iacute;veis para pessoas de todas as idades.</p>\r\n\r\n<h4><strong>Gostou? Saiba como garantir sua reserva!</strong></h4>\r\n\r\n<p><strong>Pr&oacute;xima reuni&atilde;o de vendas e apresenta&ccedil;&atilde;o do resort dia 21/03 em dois per&iacute;odos: 13h e 18h no sal&atilde;o A.&nbsp;</strong>Neste dia ser&aacute; poss&iacute;vel fechar o seu pacote com a APVE, pois&nbsp;acontecer&aacute; um encontro com a respons&aacute;vel pelas vendas da ag&ecirc;ncia de turismo. Na ocasi&atilde;o, ela vai tirar todas as d&uacute;vidas sobre a viagem e fazer as vendas.</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4><strong>Investimento da viagem:</strong></h4>\r\n\r\n<p>&bull;&nbsp;&nbsp; &nbsp;20 a 24/08 &ndash; R$3.214,00;&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;25 a 29/09 &ndash; R$3.663,00;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Traslado SJC-Aeroporto e Aeroporto-SJC: R$150,00 &ndash; S&oacute;cios&nbsp;<br />\r\nR$180,00 &ndash; N&atilde;o S&oacute;cios.&nbsp;</p>\r\n\r\n<p><em><strong>Obs.: o passeio pode ser pago em at&eacute; 10 vezes no cart&atilde;o de cr&eacute;dito. A taxa do traslado pode ser feita em at&eacute; 3 vezes no cart&atilde;o de cr&eacute;dito.</strong></em></p>\r\n\r\n<h4><br />\r\n<strong>Incluso no pagamento (diretamente com o Cost&atilde;o do Santinho):</strong></h4>\r\n\r\n<p><br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hospedagem (com todas refei&ccedil;&otilde;es e bebidas inclusas*);<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Acomoda&ccedil;&atilde;o: Vilas Portuguesas &ndash; apartamento duplo, triplo, quadruplo ou qu&iacute;ntuplo;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;A&eacute;reo (Florian&oacute;polis/SC) e uma bagagem de 23 kg despachada (a&eacute;reo com sa&iacute;da de Guarulhos ou Congonhas);<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Transfer: &ldquo;aeroporto x resort&rdquo; e &ldquo;resort x aeroporto&rdquo;;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Taxas.<br />\r\n*Vip inclusive: refei&ccedil;&otilde;es, lanches, frigobar (&aacute;gua e refrigerante), sucos, drinks, caipirinhas com vodka sagatiba e vodka sky, chopp e cerveja, vinhos selecionados, whisky 8 anos e espumante nacional.&nbsp;<br />\r\n&nbsp;<br />\r\nObs.: valores diferenciados para crian&ccedil;as (at&eacute; 11 anos). Outros tipos de acomoda&ccedil;&atilde;o podem ser consultados.&nbsp;</p>\r\n\r\n<p>Mais informa&ccedil;&otilde;es podem ser consultadas pelo e-mail apve@apve.com.br ou pelo WhatsApp (12) 3925-5215. A sede da APVE fica localizada na Alameda C&acirc;ndido Marciano Leite, n&ordm; 88, no bairro Vila Beth&acirc;nia, em S&atilde;o Jos&eacute; dos Campos/SP.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Servi&ccedil;o:</strong><br />\r\nViagem Resort Cost&atilde;o do Santinho<br />\r\nPer&iacute;odo: de 20 a 24 de agosto e de 25 a 29 de setembro<br />\r\nVendas: <strong>Pr&oacute;xima reuni&atilde;o de vendas e apresenta&ccedil;&atilde;o do resort dia 21/03 em dois per&iacute;odos: 13h e 18h no sal&atilde;o A.&nbsp;</strong><br />\r\nInforma&ccedil;&otilde;es: e-mail apve@apve.com.br ou pelo WhatsApp (12) 3925-5215.&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 15:44:37','2023-02-27 15:44:37'),
(2403,408,'1',NULL,2197,'<h1 style=\"text-align: center;\"><strong>Torneio de bilhar acontece em mar&ccedil;o na APVE</strong><br />\r\n<em>Evento acontecer&aacute; de 20 a 24 de mar&ccedil;o, a partir das 17h</em></h1>\r\n\r\n<p><br />\r\nA Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE) realizar&aacute;, de 20 a 24 de mar&ccedil;o, no sal&atilde;o de jogos, um torneio de bilhar. Podem participar da competi&ccedil;&atilde;o s&oacute;cios e visitantes j&aacute; cadastrados no sistema da institui&ccedil;&atilde;o.<br />\r\nCom o objetivo de levar entretenimento aos frequentadores, possibilitando uma competi&ccedil;&atilde;o amistosa e divertida, os participantes ter&atilde;o a oportunidade de testar jogadas e de, quem sabe, levar para casa o trof&eacute;u de primeiro lugar.<br />\r\nPara participar, os interessados devem procurar a secretaria da APVE, no per&iacute;odo de 9 a 16 de mar&ccedil;o, e realizar o pagamento da taxa de R$ 10. No dia 17 de mar&ccedil;o, &agrave;s 17h, os organizadores do evento far&atilde;o o sorteio das chaves, assim como definir&atilde;o a ordem de jogada.<br />\r\nAp&oacute;s a partida final, todos os competidores est&atilde;o convidados a participar de um coquetel de confraterniza&ccedil;&atilde;o.</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nTorneio de Bilhar<br />\r\nData: de 20 a 24 de mar&ccedil;o<br />\r\nInscri&ccedil;&otilde;es: de 9 a 16 de mar&ccedil;o<br />\r\nValor: R$ 10<br />\r\nDefini&ccedil;&atilde;o das chaves: 17 de mar&ccedil;o, 17h<br />\r\nLocal: Sal&atilde;o de jogos da APVE<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 15:46:09','2023-02-27 15:46:09'),
(2406,425,'1',NULL,2216,'<h1 style=\"text-align: center;\"><strong>Planejamento patrimonial e sucess&oacute;rio &eacute; tema de palestra na APVE</strong><br />\r\n<em>Profissionais da &aacute;rea apresentar&atilde;o estrat&eacute;gias financeiras para gerir adequadamente os bens patrimoniais</em></h1>\r\n\r\n<p><br />\r\nA Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE), no dia <strong>9 de mar&ccedil;o, &agrave;s 19h</strong>, trar&aacute; a palestra &ldquo;Estrat&eacute;gias Financeiras para um Planejamento Patrimonial e Sucess&oacute;rio Assertivo e Eficaz&rdquo;, com os especialistas Mauri Mendes, Pedro Henrique e Pedro Oliveira.&nbsp;<br />\r\nOs palestrantes abordar&atilde;o temas como cen&aacute;rio econ&ocirc;mico e financeiro, al&eacute;m de oportunidades de investimentos, sempre trazendo an&aacute;lises embasadas nos pilares: jur&iacute;dico, tribut&aacute;rio e financeiro.<br />\r\nO encontro visa apresentar ferramentas financeiras eficazes no gerenciamento do patrim&ocirc;nio familiar, que, quando utilizadas, proporcionam conforto e bem-estar para as gera&ccedil;&otilde;es futuras.<br />\r\nO evento &eacute; aberto ao p&uacute;blicos e tem entrada solid&aacute;ria de R$ 10,00 e toda renda arrecadada&nbsp;ser&aacute; destinado a entidades assistidas pelo RENOPAS. Para se inscrever, acesse o link abaixo.</p>\r\n\r\n<p><strong><a class=\"btn btn-primary\" href=\"https://forms.office.com/r/y5TMGFWXdi\">Inscri&ccedil;&otilde;es aqui</a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><strong>Sobre os palestrantes:</strong></h4>\r\n\r\n<p><strong>Mauri Mendes:&nbsp;</strong>P&oacute;s-graduado em Controladoria Financeira - FAAP / S&oacute;cio e Assessor de Investimentos na Riva Investimentos / Ocupou os cargos de Diretor Financeiro da APVE 2010 &ndash; 2017 / Conselheiro Deliberativo EmbraerPrev 2010 &ndash; 2019 e Conselheiro Fiscal CooperEmb 2010 &ndash; 2016.<br />\r\n<strong>Pedro Oliveira:</strong>&nbsp;Engenheiro, Mestrado em Planejamento Financeiro &ndash; Unicamp, P&oacute;s-graduado em Finan&ccedil;as Corporativas - UFS / Head Comercial e Financeiro na Riva Investimentos, Especialista em Prote&ccedil;&atilde;o Financeira e Planejamento Sucess&oacute;rio.<br />\r\n<strong>Pedro Rocha:</strong> Advogado, P&oacute;s-graduado em Direito Imobili&aacute;rio &ndash; IBMEC e Direito Empresarial &ndash; FGV &ndash; Especialista em Planejamento Sucess&oacute;rio.</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nPalestra: Planejamento patrimonial e sucess&oacute;rio<br />\r\nData: 9 de mar&ccedil;o<br />\r\nHor&aacute;rio: 19h<br />\r\nInscri&ccedil;&otilde;es:&nbsp;<a href=\"https://forms.office.com/r/y5TMGFWXdi\">https://forms.office.com/r/y5TMGFWXdi&nbsp;</a><br />\r\nLocal: sal&atilde;o A da APVE<br />\r\nEntrada solid&aacute;ria: R$10,00<br />\r\nInforma&ccedil;&otilde;es: (12) 3925-5200</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-27 17:41:33','2023-02-27 17:41:33'),
(2407,423,'0',NULL,NULL,'<h1><em>Profissionais da &aacute;rea apresentar&atilde;o estrat&eacute;gias financeiras para gerir adequadamente os bens patrimoniais</em></h1>\r\n\r\n<p><br />\r\nA Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE), no dia&nbsp;<strong>9 de mar&ccedil;o, &agrave;s 19h</strong>, trar&aacute; a palestra &ldquo;Estrat&eacute;gias Financeiras para um Planejamento Patrimonial e Sucess&oacute;rio Assertivo e Eficaz&rdquo;, com os especialistas Mauri Mendes, Pedro Henrique e Pedro Oliveira.&nbsp;<br />\r\nOs palestrantes abordar&atilde;o temas como cen&aacute;rio econ&ocirc;mico e financeiro, al&eacute;m de oportunidades de investimentos, sempre trazendo an&aacute;lises embasadas nos pilares: jur&iacute;dico, tribut&aacute;rio e financeiro.<br />\r\nO encontro visa apresentar ferramentas financeiras eficazes no gerenciamento do patrim&ocirc;nio familiar, que, quando utilizadas, proporcionam conforto e bem-estar para as gera&ccedil;&otilde;es futuras.<br />\r\nO evento &eacute; aberto aos s&oacute;cios e tem entrada solid&aacute;ria de R$ 10,00 e toda renda arrecada s&atilde;o para entidades assistidas pelo Renopas.&nbsp;Para se inscrever, acesse o link abaixo.</p>\r\n\r\n<p><strong><a href=\"https://forms.office.com/r/y5TMGFWXdi\">Inscri&ccedil;&otilde;es aqui</a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4><strong>Sobre os palestrantes:</strong></h4>\r\n\r\n<p><strong>Mauri Mendes:&nbsp;</strong>P&oacute;s-graduado em Controladoria Financeira - FAAP / S&oacute;cio e Assessor de Investimentos na Riva Investimentos / Ocupou os cargos de Diretor Financeiro da APVE 2010 &ndash; 2017 / Conselheiro Deliberativo EmbraerPrev 2010 &ndash; 2019 e Conselheiro Fiscal CooperEmb 2010 &ndash; 2016.<br />\r\n<strong>Pedro Oliveira:</strong>&nbsp;Engenheiro, Mestrado em Planejamento Financeiro &ndash; Unicamp, P&oacute;s-graduado em Finan&ccedil;as Corporativas - UFS / Head Comercial e Financeiro na Riva Investimentos, Especialista em Prote&ccedil;&atilde;o Financeira e Planejamento Sucess&oacute;rio.<br />\r\n<strong>Pedro Rocha:</strong>&nbsp;Advogado, P&oacute;s-graduado em Direito Imobili&aacute;rio &ndash; IBMEC e Direito Empresarial &ndash; FGV &ndash; Especialista em Planejamento Sucess&oacute;rio.</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong><br />\r\nPalestra: Planejamento patrimonial e sucess&oacute;rio<br />\r\nData: 9 de mar&ccedil;o<br />\r\nHor&aacute;rio: 19h<br />\r\nInscri&ccedil;&otilde;es:&nbsp;<a href=\"https://forms.office.com/r/y5TMGFWXdi\">https://forms.office.com/r/y5TMGFWXdi&nbsp;</a><br />\r\nLocal: sal&atilde;o A da APVE<br />\r\nEntrada solid&aacute;ria: entrada solid&aacute;ria de R$ 10,00<br />\r\nInforma&ccedil;&otilde;es: (12) 3925-5200</p>',NULL,3,NULL,'right',NULL,NULL,NULL,NULL,'2023-02-27 17:44:48','2023-02-27 17:44:48'),
(2408,426,'1',NULL,2223,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><em><strong>&ldquo;Doe Hist&oacute;ria&rdquo;: APVE encabe&ccedil;a campanha de arrecada&ccedil;&atilde;o de obras infantis e juvenis</strong></em><br />\r\nOs livros ser&atilde;o doados para a Escola Euclides Miragaia; campanha segue at&eacute; final de mar&ccedil;o</h1>\r\n\r\n<p style=\"text-align: justify;\">Maria Jos&eacute; Dupr&eacute;, Pedro Bandeira, Ana Maria Machado. Estes s&atilde;o autores de livros cl&aacute;ssicos da literatura infanto-juvenil que compuseram o imagin&aacute;rio de muitas gera&ccedil;&otilde;es. E agora, para contribuir com a forma&ccedil;&atilde;o de novos jovens, a Associa&ccedil;&atilde;o de Pioneiros e Veteranos da Embraer (APVE) est&aacute; com a Campanha &ldquo;Doe Hist&oacute;ria&rdquo;, que se prop&otilde;e a arrecadar obras liter&aacute;rias voltadas para crian&ccedil;as e adolescentes. Todos os livros ser&atilde;o destinados &agrave; biblioteca da Escola Euclides Miragaia.</p>\r\n\r\n<p style=\"text-align: justify;\">Visando levar um pouco de hist&oacute;ria e de proporcionar momentos de muita imagina&ccedil;&atilde;o, a APVE pretende contribuir para a revitaliza&ccedil;&atilde;o da biblioteca da referida escola e, assim, possibilitar o acesso dos jovens a diversos conte&uacute;dos liter&aacute;rios. Esta &eacute; a primeira campanha de doa&ccedil;&atilde;o de livros do ano, devendo seguir at&eacute; o final do m&ecirc;s de mar&ccedil;o.</p>\r\n\r\n<p style=\"text-align: justify;\">Para participar da campanha &ldquo;Doe Hist&oacute;ria&rdquo;, basta depositar os livros nos locais sinalizados nas entradas da APVE, das 6h &agrave;s 21h, de segunda a sexta, ou s&aacute;bado, das 8h &agrave;s 12h. A participa&ccedil;&atilde;o de cada um levar&aacute; ainda mais cores e sonhos aos estudantes da Euclides Miragaia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Servi&ccedil;o:</strong></p>\r\n\r\n<p>Doa&ccedil;&atilde;o de livros<br />\r\nPer&iacute;odo: fevereiro e mar&ccedil;o<br />\r\nHor&aacute;rios: das 6h &agrave;s 21h, de segunda a sexta, ou s&aacute;bado, das 8h &agrave;s 12h<br />\r\nLocal: APVE<br />\r\nInforma&ccedil;&otilde;es: (12) 3925-5200<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-02-28 10:27:26','2023-02-28 10:27:26'),
