(2415,212,'1',NULL,953,'<h4>Massagem e Terapias</h4>\r\n\r\n<p>Seg a Sab: agendar hor&aacute;rio.<br />\r\nValores: consulte pelo telefone (12) 99152-3517<br />\r\nMassagens: Massagem Relaxante, Drenagem Linf&aacute;tica,<br />\r\nReflexologia Podal, Quiromassagem, Quick Massage,<br />\r\nManipula&ccedil;&atilde;o de Coluna (Sei Tai) e Shiatsu<br />\r\nTerapias: Acupuntura, Auriculoterapia, Cone Chin&ecirc;s, Reiki,<br />\r\nVentosaterapia, Calatonia, Terapia da Polaridade e Moxaterapia.</p>',NULL,9,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2416,212,'1',NULL,937,'<h4>Atendimento M&eacute;dico</h4>\r\n\r\n<p>M&eacute;dico Respons&aacute;vel Dr. Fabio Baptista<br />\r\nExame Ergom&eacute;trico e Avalia&ccedil;&atilde;o Cardiol&oacute;gica<br />\r\nQua: das 08h &agrave;s 10h. Agendar hor&aacute;rio.<br />\r\nTelefone (12) 3921-1112 (WhatsApp)<br />\r\n&nbsp;</p>',NULL,10,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2417,212,'1',NULL,952,'<h4>Inspe&ccedil;&atilde;o de Pele</h4>\r\n\r\n<p>Ter&ccedil;as-feiras: das 9h &agrave;s 12h e das 13h &agrave;s 15h.<br />\r\nQuartas-feiras: das 16h &agrave;s 20h.<br />\r\nS&aacute;bados: das 9h &agrave;s 12h e das 13h &agrave;s 15h.<br />\r\nValor R$ 10,00</p>',NULL,11,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2418,212,'1',NULL,926,'<h4>Hidrogin&aacute;stica</h4>\r\n\r\n<p>Atividade exige atestado m&eacute;dico e a inspe&ccedil;&atilde;o de pele atualizada.&nbsp;</p>\r\n\r\n<p>Ter e Qui: 7h &agrave;s 7h50 | 8h &agrave;s 8h50 | 14h &agrave;s 14h50 | 15h &agrave;s 15h50 |18h10 &agrave;s 19h | 19h15 &agrave;s 20h05<br />\r\nQua e Sex: 7h &agrave;s 7h50 | 8h &agrave;s 8h50 | 14h &agrave;s 14h50 | 15h &agrave;s 15h50 |18h10 &agrave;s 19h | 19h20 &agrave;s 20h10<br />\r\nS&aacute;b: 7h55 &agrave;s 8h45<br />\r\nMensal - Exclusivo para associados R$30,00<br />\r\n&nbsp;</p>',NULL,12,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2419,212,'1',NULL,931,'<h4>Nata&ccedil;&atilde;o Adulto</h4>\r\n\r\n<p>Atividade exige atestado m&eacute;dico e a inspe&ccedil;&atilde;o de pele atualizada.</p>\r\n\r\n<p>Mensal - Exclusivo para associados R$30,00</p>\r\n\r\n<p>- Aula Teste<br />\r\nQua e Sex: 10h30 &agrave;s 11h15 | 17h45 &agrave;s 18h30</p>\r\n\r\n<p>Ter e Qui:<br />\r\nIniciante:&nbsp;<br />\r\nA - 10h10 &agrave;s 10h 50 / B -11h15 &agrave;s 11h45 / B - 16h &agrave;s 16h40<br />\r\nB -20h10 &agrave;s 21h00<br />\r\nIntermedi&aacute;rio / avan&ccedil;ado: 7h &agrave;s 7h50 / 8h &agrave;s 8h50 / 11h &agrave;s 11h50 / 17h20 &agrave;s 18h10<br />\r\nIntermedi&aacute;rio: 15h30 &agrave;s 16h20/ 18h15 &agrave;s 19h05 / 19h10 &agrave;s 20h<br />\r\nAvan&ccedil;ado: 20h05 &agrave;s 21h</p>\r\n\r\n<p>Qua Sex:<br />\r\nIniciante: A - 7h &agrave;s 7h50 / A - 8h &agrave;s 8h50 / A - 11h20 &agrave;s 12h / B -11h25 &agrave;s 12h05 / B - 17h20 &agrave;s 18h / A - 20h10 &agrave;s 21h<br />\r\nIniciante e Intermedi&aacute;rio: 9h35 &agrave;s 10h25<br />\r\nIntermedi&aacute;rio: 15h25 &agrave;s 16h15<br />\r\nIntermedi&aacute;rio e Avan&ccedil;ado: 19h20 &agrave;s 20h10<br />\r\nAvan&ccedil;ado: 14h &agrave;s 14h50<br />\r\nSab - Iniciante: 7h &agrave;s 7h50<br />\r\n&nbsp;</p>',NULL,13,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2420,212,'1',NULL,932,'<h4>Nata&ccedil;&atilde;o&nbsp;Infantil (dos 6 aos 13 anos)</h4>\r\n\r\n<p>Atividade exige atestado m&eacute;dico e a inspe&ccedil;&atilde;o de pele atualizada.</p>\r\n\r\n<p>- Aula Teste<br />\r\nQua e Sex: 10h30 &agrave;s 11h15 | 17h45 &agrave;s 18h30</p>\r\n\r\n<p>Ter e Qui:<br />\r\nIniciante: A - 9h &agrave;s 9h30 / B - 9h &agrave;s 9h30/ A - 9h35 &agrave;s 10h05/ B - 9h35 &agrave;s 10h05 / A - 14h55 &agrave;s 15h25<br />\r\nIntermedi&aacute;rio: 16h30 &agrave;s 17h20<br />\r\nAvan&ccedil;ado: 14h &agrave;s 14h50 / 16h30 &agrave;s 17h20</p>\r\n\r\n<p>Qua Sex:<br />\r\nIniciante: A - 9h &agrave;s 9h30 / B - 9h &agrave;s 9h30/ B - 9h35 &agrave;s 10h05 / A -14h50 &agrave;s 15h20 / B - 16h &agrave;s 16h30 / A - 16h15 &agrave;s 16h45 / B - 16h40 &agrave;s 17h10<br />\r\nIntermedi&aacute;rio: 16h50 &agrave;s 17h40 / 17h40 &agrave;s 18h30 / 18h30 &agrave;s 19h20<br />\r\nIntermedi&aacute;rio / Avan&ccedil;ado: 10h30 &agrave;s 11h20<br />\r\nS&aacute;b:<br />\r\nIniciante: B - 10h &agrave;s 10h30 / B - 10h35 &agrave;s 11h05 / B - 11h10 &agrave;s 11h40</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4>Pais e Filhos (dos 3 aos 5 anos, acompanhada dos pais)</h4>\r\n\r\n<p>Ter e Qui: 16h50 &agrave;s 17h20 / 17h30 &agrave;s 18h00<br />\r\nQua e Sex: 10h10 &agrave;s 10h40 / 10h45 &agrave;s 11h15<br />\r\nS&aacute;bados: 8h50 &agrave;s 9h20 / 9h25 &agrave;s 9h55</p>\r\n\r\n<p>*Atividades de nata&ccedil;&atilde;o s&atilde;o exclusivos para associados. R$ 30,00 por m&ecirc;s/cada.<br />\r\n&nbsp;</p>',NULL,14,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2421,212,'1',NULL,1397,'<h4><strong>Grupo de Corrida e Caminha APVE</strong></h4>\r\n\r\n<p>Treinos: ter&ccedil;as e quintas-feiras &agrave;s 7h10 e domingo &agrave;s 7h.</p>\r\n\r\n<p>Inscri&ccedil;&otilde;es: na academia da APVE com a professora Rafaela.</p>\r\n\r\n<p>Informa&ccedil;&otilde;es pelo telefone: (12) 3925-5219.</p>\r\n\r\n<p>Atividade exclusiva para associados.</p>',NULL,15,'col-sm-8','left','col-sm-4','col-sm-12',NULL,'card card-body bg-white mt-3','2023-03-01 16:52:07','2023-03-01 16:52:07'),
(2422,427,'1',NULL,2227,'<h1 style=\"text-align: center;\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align: center;\"><strong>APVE fecha novo contrato com o conv&ecirc;nio m&eacute;dico da Unimed</strong><br />\r\nInclus&otilde;es realizadas entre 01/03 &agrave; 31/03, nos planos APVE Flex 25 e Participativo, ter&atilde;o car&ecirc;ncia reduzida</h1>\r\n\r\n<p><br />\r\nSeparamos uma novidade para quem quer economizar com plano de sa&uacute;de. Em parceria com a UNIMED, a APVE agora tem dois novos planos: APVE Flex 25 e Participativo. E os associados que fizerem a contrata&ccedil;&atilde;o entre 01/03 a 31/03, ter&atilde;o car&ecirc;ncia reduzida, exceto para Doen&ccedil;as ou Les&otilde;es Preexistentes (DLP) e parto.<br />\r\nNa op&ccedil;&atilde;o APVE Flex 25, o diferencial &eacute; a ado&ccedil;&atilde;o do sistema coparticipativo apenas em consultas (consult&oacute;rios e pronto atendimento), nas quais o associado paga o valor m&iacute;nimo de R$ 25,00. J&aacute; no plano Participativo, &eacute; cobrada uma coparticipa&ccedil;&atilde;o em cima exames, interna&ccedil;&otilde;es, procedimentos, exames (b&aacute;sicos e especiais) e interna&ccedil;&atilde;o, mas o valor da mensalidade &eacute; reduzido.<br />\r\nNesse per&iacute;odo, o associado poder&aacute; adquirir seu plano m&eacute;dico sem tarifas de inscri&ccedil;&atilde;o e contar com uma das mais completas estruturas hospitalares da regi&atilde;o, com vasta gama de especialidades m&eacute;dicas, al&eacute;m de an&aacute;lise de exames, exames de alta complexidade e interna&ccedil;&otilde;es.<br />\r\nA ades&atilde;o pode ser feita por funcion&aacute;rios e ex-funcion&aacute;rios da Embraer que sejam associados &agrave; APVE e seus dependentes. Os interessados podem entrar em contato com a secretaria de conv&ecirc;nios da APVE pelos telefones (12) 3925-5205 (WhatsApp) / 3925-5213 ou por e-mail convenios@apve.com.br.&nbsp;<br />\r\nN&atilde;o perca essa oportunidade. Cuide de voc&ecirc; e de sua fam&iacute;lia!<br />\r\n&nbsp;</p>',NULL,3,NULL,'none',NULL,NULL,NULL,NULL,'2023-03-01 17:50:00','2023-03-01 17:50:00'),
